(23, 63, 1, 49, 50, 1, 'events2011', 'com_content', 'Events 2011', 'events2011', '', '<p>  800x600    Normal 0     false false false  EN-US X-NONE X-NONE            MicrosoftInternetExplorer4                                                                                                                                                          \r\n\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n	{mso-style-name:"Table Normal";\r\n	mso-tstyle-rowband-size:0;\r\n	mso-tstyle-colband-size:0;\r\n	mso-style-noshow:yes;\r\n	mso-style-priority:99;\r\n	mso-style-parent:"";\r\n	mso-padding-alt:0in 5.4pt 0in 5.4pt;\r\n	mso-para-margin:0in;\r\n	mso-para-margin-bottom:.0001pt;\r\n	mso-pagination:widow-orphan;\r\n	font-size:10.0pt;\r\n	font-family:"Calibri","sans-serif";\r\n	mso-bidi-font-family:"Times New Roman";}\r\n\r\n</p>\r\n<p class="MsoNormal" style="text-align: center;"><strong><span style="text-decoration: underline;"><span style="font-size: 20pt; line-height: 115%;">Tentative Events in 2011</span></span></strong></p>\r\n<p class="MsoListParagraphCxSpFirst" style="margin-left: 0in;"><strong><span style="font-size: 12pt; line-height: 115%; font-family: "> </span></strong></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left: 31.5pt;"><span style="font-size: 12pt; line-height: 115%; font-family: "> </span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left: 31.5pt;"><strong><span style="font-size: 12pt; line-height: 115%; font-family: "> </span></strong></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left: 31.5pt; text-indent: -0.25in;"><strong><span style="font-size: 12pt; line-height: 115%; font-family: "><span>1.<span style="font: 7pt " New="New" Roman";"="Roman";""> </span></span></span></strong><strong><span style="font-size: 12pt; line-height: 115%; font-family: ">One Day Workshop/Talk on Artificial Intelligence â€“ 19<sup>th</sup> February, 2011</span></strong></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left: 31.5pt;"><span style="font-size: 12pt; line-height: 115%; font-family: ">To quest your thirst to make machines work like you. DA-IICT Student Branch brings one day workshop to start your footsteps in this direction.</span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left: 31.5pt; text-indent: -0.25in;"><strong><span style="font-size: 12pt; line-height: 115%; font-family: "><span>2.<span style="font: 7pt " New="New" Roman";"="Roman";""> </span></span></span></strong><strong><span style="font-size: 12pt; line-height: 115%; font-family: ">Nano Technology Seminar</span></strong></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left: 31.5pt;"><span style="font-size: 12pt; line-height: 115%; font-family: ">Through this seminar we would try to bring virtual aspect to the essence of Nano Science through videos and presentations</span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left: 31.5pt; text-indent: -0.25in;"><strong><span style="font-size: 12pt; line-height: 115%; font-family: "><span>3.<span style="font: 7pt " New="New" Roman";"="Roman";""> </span></span></span></strong><strong><span style="font-size: 12pt; line-height: 115%; font-family: ">Robotics Competition</span></strong></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left: 31.5pt; text-align: justify;"><span class="apple-style-span"><span style="font-size: 12pt; line-height: 115%; font-family: " color:="color:" black;"="black;"">This competition is an interesting game- cum- intellectual exercise for budding engineers and their enthusiastic instructors, determined to innovate and create machines for producing desired results</span></span><strong></strong></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left: 31.5pt; text-indent: -0.25in;"><strong><span style="font-size: 12pt; line-height: 115%; font-family: "><span>4.<span style="font: 7pt " New="New" Roman";"="Roman";""> </span></span></span></strong><strong><span style="font-size: 12pt; line-height: 115%; font-family: ">National Level Coding Competition</span></strong></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left: 31.5pt; text-align: justify;"><span class="apple-style-span"><span style="font-size: 12pt; line-height: 115%; font-family: " color:="color:" black;"="black;"">Prove yourself in the test of not only skills, but also endurance and perseverance as you make your way through a series of problems equipped with C, C++ and Java as your tools.</span></span><strong></strong></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin: 0in 0in 0.0001pt 31.5pt; text-indent: -0.25in; line-height: normal;"><strong><span style="font-size: 12pt; font-family: "><span>5.<span style="font: 7pt " New="New" Roman";"="Roman";""> </span></span></span></strong><strong><span style="font-size: 12pt; font-family: ">Cloud Computing</span></strong></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin: 0in 0in 0.0001pt 31.5pt; text-align: justify; line-height: normal;"><span style="font-size: 12pt; font-family: ">This workshop will attempt to cover matter relevant to giving Students and Professionals necessary knowledge and skill set to appreciate the rapidly changing scenario in Cloud Computing and take advantage of this in furthering th', -2, 0, '0000-00-00 00:00:00', 1, '{"category_layout":"","image":""}', '', '', '{"author":"","robots":""}', 42, '2011-03-22 11:12:42', 42, '2011-03-26 00:41:58', 0, '*'),
