(1, 46, 'About IEEE Gujrat Section', 'about-ieee-gujrat-section', '', '<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: 15.6pt; background: white;">Â </p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: 15.6pt; background: white;"><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: #333333; mso-fareast-language: EN-IN;">The IEEE Gujarat Section endeavors to promote awareness among students on the opportunities that exist in the field of electronics and electrical engineering. Our objective is to bridge the gap between industry and students studying in technology-related fields, while promoting and providing an intellectually stimulating university environment for the student body.</span></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: 15.6pt; background: white;"><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: #333333; mso-fareast-language: EN-IN;">On 15th August 1990, IEEE Hq. approved IEEE Gujarat Sub- Section in a full-fledged IEEE Gujarat Section. IEEE Gujarat Section is one of the 10 Sections in India coming under Asia-Pacific Region, the Region 10 of IEEE.</span></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: 15.6pt; background: white;"><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: #333333; mso-fareast-language: EN-IN;">Though preparations started much earlier by Professor Akshai K. Aggarwal. Associated with him were many other active members from both the industry and academia. ONGC, SAC (ISRO), Inductotherm, Amtech Electronics, Hirel Electronics, faculty members of DDIT, MS Univ, many entrepreneur engineers were among the key contributors while conceiving this section. Roughly speaking membership strength of active members is around 500, among which 300 are student members belonging to various student branches. We have 1 Fellow, 25 Senior Members, 170 Members and 15 Associate Members. In 1990 there were around 100 members. These figures may not be precise, only indicative.</span></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: 15.6pt; background: white;"><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: #333333; mso-fareast-language: EN-IN;">The Section has had the good fortune of association of eminent professionals as Members or Convenors/Chairmen of various technical/program committees.</span></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: 15.6pt; background: white;"><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: #333333; mso-fareast-language: EN-IN;">In past years, IEEE Gujarat Section was very active in organizing various state and national level technical events for the benefit of student of Gujarat, in particular. These include</span></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; margin-left: 42.0pt; text-indent: -18.0pt; line-height: 15.6pt; mso-list: l2 level1 lfo1; tab-stops: list 36.0pt; background: white;"><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: #333333; mso-fareast-language: EN-IN;"><span style="mso-list: Ignore;">1.<span style="font: 7.0pt &quot;Times New Roman&quot;;"> </span></span></span><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: #333333; mso-fareast-language: EN-IN;">National Workshop on Challenges in VLSI</span></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; margin-left: 42.0pt; text-indent: -18.0pt; line-height: 15.6pt; mso-list: l2 level1 lfo1; tab-stops: list 36.0pt; background: white;"><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: #333333; mso-fareast-language: EN-IN;"><span style="mso-list: Ignore;">2.<span style="font: 7.0pt &quot;Times New Roman&quot;;"> </span></span></span><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: #333333; mso-fareast-language: EN-IN;">Two-day Intensive Workshop on Embedded Systems</span></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; margin-left: 42.0pt; text-indent: -18.0pt; line-height: 15.6pt; mso-list: l2 level1 lfo1; tab-stops: list 36.0pt; background: white;"><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: #333333; mso-fareast-language: EN-IN;"><span style="mso-list: Ignore;">3.<span style="font: 7.0pt &quot;Times New Roman&quot;;"> </span></span></span><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: #333333; mso-fareast-language: EN-IN;">Half Day Seminar on Artificial Intelligence</span></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; margin-left: 42.0pt; text-indent: -18.0pt; line-height: 15.6pt; mso-list: l2 level1 lfo1; tab-stops: list 36.0pt; background: white;"><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: #333333; mso-fareast-language: EN-IN;"><span style="mso-list: Ignore;">4.<span style="font: 7.0pt &quot;Times New Roman&quot;;"> </span></span></span><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: #333333; mso-fareast-language: EN-IN;">National Symposium on Packet Data Services in CDMA</span></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: 15.6pt; background: white;"><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: #333333; mso-fareast-language: EN-IN;">In year 2006 also we started with great zeal and enthusiasm with successful organization of the following programmes</span></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; margin-left: 42.0pt; text-indent: -18.0pt; line-height: 15.6pt; mso-list: l1 level1 lfo2; tab-stops: list 36.0pt; background: white;"><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: #333333; mso-fareast-language: EN-IN;"><span style="mso-list: Ignore;">1.<span style="font: 7.0pt &quot;Times New Roman&quot;;"> </span></span></span><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: #333333; mso-fareast-language: EN-IN;">Workshop on MPEG</span></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; margin-left: 42.0pt; text-indent: -18.0pt; line-height: 15.6pt; mso-list: l1 level1 lfo2; tab-stops: list 36.0pt; background: white;"><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: #333333; mso-fareast-language: EN-IN;"><span style="mso-list: Ignore;">2.<span style="font: 7.0pt &quot;Times New Roman&quot;;"> </span></span></span><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: #333333; mso-fareast-language: EN-IN;">Two Day Intensive Workshop on VLSI Chip Design</span></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; margin-left: 42.0pt; text-indent: -18.0pt; line-height: 15.6pt; mso-list: l1 level1 lfo2; tab-stops: list 36.0pt; background: white;"><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: #333333; mso-fareast-language: EN-IN;"><span style="mso-list: Ignore;">3.<span style="font: 7.0pt &quot;Times New Roman&quot;;"> </span></span></span><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: #333333; mso-fareast-language: EN-IN;">National Seminar on Computer Vision and Image Processing</span></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; margin-left: 42.0pt; text-indent: -18.0pt; line-height: 15.6pt; mso-list: l1 level1 lfo2; tab-stops: list 36.0pt; background: white;"><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: #333333; mso-fareast-language: EN-IN;"><span style="mso-list: Ignore;">4.<span style="font: 7.0pt &quot;Times New Roman&quot;;"> </span></span></span><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: #333333; mso-fareast-language: EN-IN;">Intensive Workshop on Service-Oriented Computing</span></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: 15.6pt; background: white;"><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: #333333; mso-fareast-language: EN-IN;">We received IEEE R10 Distinguished Small Section Award for year 2005 based on the activities we conducted in 2004. This includes 12th International Conference on GRID COMPUTING which was held at Nirma University during December 2004.</span></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: 15.6pt; mso-outline-level: 3; background: white;">Â </p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: 15.6pt; mso-outline-level: 3; background: white;"><strong><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; mso-fareast-language: EN-IN;">IEEE Student Branches Under Gujrat Section</span></strong></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: 15.6pt; mso-outline-level: 3; background: white;"><strong><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; mso-fareast-language: EN-IN;"> </span></strong>An "IEEE Student Branch" is an IEEE entity that helps students in a specific educational institution. There are around 375 approved student branches in R10, few of them are not so active (50 have become dormant over a period of time). Of these, over 150 student branches are located in many major Universities and Engineering Colleges all over India. Each Student Branch is attached to the nearest IEEE Section.</p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; line-height: 15.6pt; background: white;"><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: #333333; mso-fareast-language: EN-IN;"> </span></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; margin-left: 42.0pt; text-indent: -18.0pt; line-height: 15.6pt; mso-list: l0 level1 lfo3; tab-stops: list 36.0pt; background: white;"><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: #333333; mso-fareast-language: EN-IN;"><span style="mso-list: Ignore;">1.<span style="font: 7.0pt &quot;Times New Roman&quot;;"> </span></span></span><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: #333333; mso-fareast-language: EN-IN;">M S (Maharaja Sayajirao) University, Vadodara (1st Student Branch under Gujarat Section)</span></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; margin-left: 42.0pt; text-indent: -18.0pt; line-height: 15.6pt; mso-list: l0 level1 lfo3; tab-stops: list 36.0pt; background: white;"><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: #333333; mso-fareast-language: EN-IN;"><span style="mso-list: Ignore;">2.<span style="font: 7.0pt &quot;Times New Roman&quot;;"> </span></span></span><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: #333333; mso-fareast-language: EN-IN;">Gujarat University, Ahmedabad</span></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; margin-left: 42.0pt; text-indent: -18.0pt; line-height: 15.6pt; mso-list: l0 level1 lfo3; tab-stops: list 36.0pt; background: white;"><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: #333333; mso-fareast-language: EN-IN;"><span style="mso-list: Ignore;">3.<span style="font: 7.0pt &quot;Times New Roman&quot;;"> </span></span></span><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: #333333; mso-fareast-language: EN-IN;">Nirma Institute of Technology, Ahmedabad (22 September 1999)</span></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; margin-left: 42.0pt; text-indent: -18.0pt; line-height: 15.6pt; mso-list: l0 level1 lfo3; tab-stops: list 36.0pt; background: white;"><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: #333333; mso-fareast-language: EN-IN;"><span style="mso-list: Ignore;">4.<span style="font: 7.0pt &quot;Times New Roman&quot;;"> </span></span></span><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: #333333; mso-fareast-language: EN-IN;">DA-IICT, Gandhinagar (November 2004)</span></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; margin-left: 42.0pt; text-indent: -18.0pt; line-height: 15.6pt; mso-list: l0 level1 lfo3; tab-stops: list 36.0pt; background: white;"><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: #333333; mso-fareast-language: EN-IN;"><span style="mso-list: Ignore;">5.<span style="font: 7.0pt &quot;Times New Roman&quot;;"> </span></span></span><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: #333333; mso-fareast-language: EN-IN;">UV Patel College of Engineering, Mehsana (27 December 2004)</span></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; margin-left: 42.0pt; text-indent: -18.0pt; line-height: 15.6pt; mso-list: l0 level1 lfo3; tab-stops: list 36.0pt; background: white;"><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: #333333; mso-fareast-language: EN-IN;"><span style="mso-list: Ignore;">6.<span style="font: 7.0pt &quot;Times New Roman&quot;;"> </span></span></span><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: #333333; mso-fareast-language: EN-IN;">ADIT (A D Patel Institute of Technology), New V V Nagar (16 Feb 2006)</span></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; margin-left: 42.0pt; text-indent: -18.0pt; line-height: 15.6pt; mso-list: l0 level1 lfo3; tab-stops: list 36.0pt; background: white;"><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: Calibri; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: #333333; mso-fareast-language: EN-IN;"><span style="mso-list: Ignore;">7.<span style="font: 7.0pt &quot;Times New Roman&quot;;"> </span></span></span><span style="mso-ascii-font-family: Calibri; mso-fareast-font-family: &quot;Times New Roman&quot;; mso-hansi-font-family: Calibri; mso-bidi-font-family: Calibri; color: #333333; mso-fareas