(3, 48, 'About Region 10', 'about-region-10', '', '<p>Â </p>\r\n<p>The IEEE Region 10, or sometimes referred to the Asia Pacific Region comprises 4 Councils, 47 Sections, 6 Sub-sections, 211 Chapters and 245 student branches. It covers a geographical area stretching from South Korea and Japan in the north-east to New Zealand in the south, and Pakistan in the west. With a membership in of about 60,000, it is one of the largest and fastest growing regions in IEEE.There are 10 sections in India which comes under IEEE Region 10.</p>\r\n<p>\r\n<p class="MsoNormal"><span><span style="mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin; color: #333333;"><a href="http://www.ewh.ieee.org/reg/10/"><span style="color: #1b57b1; text-decoration: none; text-underline: none;">More about Region 10</span></a></span></span><span style="mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin;"></span></p>\r\n</p>\r\n<p>Â </p>', '', 1, 0, 0, 7, '2011-03-18 23:00:34', 42, '', '2011-03-31 21:11:06', 42, 0, '0000-00-00 00:00:00', '2011-03-18 23:00:34', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 4, 0, 1, '', '', 1, 351, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
