(5, 50, 'Annual Plan - 2010', 'annual-plan-2010', '', '<p>Tentative Events in 2010</p>\r\n<p>Â </p>\r\n<p>1. 1-day workshop on Â Matlab (14â€™th March)</p>\r\n<p>Darsh and poojan</p>\r\n<p>Â </p>\r\n<p>2. 1-day Industrial visit to see application of signal processing in pharmaceuticals (4â€™th April)</p>\r\n<p>Maullik and Anit</p>\r\n<p>Â </p>\r\n<p>3. Hands on session on Verilog HDL and VLSI design simulation.</p>\r\n<p>Kedar and Gaurav Arora</p>\r\n<p>Â </p>\r\n<p>4. Workshop on Embedded Systems including hands on sessions â€“ Like the one which was done in 2006 which had motivated many students to take up embedded systems.</p>\r\n<p>Vedang and Pavas</p>\r\n<p>Â </p>\r\n<p>5. I-FEST --Kind Of event for gathering and proper fun Â (August 28-29, 2010)</p>\r\n<p>Manit,Anit,Parth,Sachin</p>\r\n<p>Â </p>\r\n<p>6. Workshop on Mobile Communication - in two days â€“one day on SW side and 2nd on the communication side. (September , 2010 )</p>\r\n<p>Gaurav Chopra, Poojan Shah</p>\r\n<p>Â </p>\r\n<p>7. Workshop on Cloud Computing (October 30-31, 2010)</p>\r\n<p>Razi,Poojan</p>\r\n<p>Â </p>\r\n<p>8. 1-day Event on artificial intelligence Â (next sem, 2010)</p>\r\n<p>Gaurav, Anit [april 10,11]</p>\r\n<p>Â </p>\r\n<p>9. Workshop On Multimedia and animation (August 7-8, 2010)</p>\r\n<p>Agni,Prateek,Aakriti</p>\r\n<p>Â </p>\r\n<p>10. An event for promotion of WIE (September 2nd half)(18-19 Sept.)</p>\r\n<p>Hetaswi,Shirali,Lokesh</p>\r\n<p>Â </p>\r\n<p>11. NANOTECH SEMINAR+ IPR TOUR â€“ Lectures in Nanotech seminar and a half day tour to IPR, where some Live projects can be demonstrated ( November 13-14, 2010) - Manit and Anit</p>\r\n<p>Â </p>\r\n<p>12. Small Activities - Parth</p>\r\n<p>1.1.1. Presentationâ€¦â€¦â€¦â€¦â€¦â€¦â€¦â€¦..</p>\r\n<p>1.1.2. Debateâ€¦ (ex. Doomsday..2012,)â€¦..</p>\r\n<p>1.1.3. New ideas (like presentation on spectrum)â€¦</p>\r\n<p>1.1.4. Small games â€¦..Like Rubik cubeâ€¦</p>\r\n<p>1.1.5. Lecture Seriesâ€¦.</p>\r\n<p>1.1.6. Tech quizâ€¦;â€¦</p>\r\n<p>Â </p>\r\n<p>13. Special Team formation for handling of Invited Talks--Talks topics will be shortly decided â€“basically it depends upon the availability of the speakers.</p>\r\n<p>Â </p>\r\n<p>New Initiatives to be taken</p>\r\n<p>- Work Shops On ADVANCED C,C++,JAVA ,</p>\r\n<p>- Survey for decision on events and a meeting with all members and prospective members.</p>\r\n<p>- More emphasis on conducting hands-on sessions.</p>\r\n<p>Â </p>\r\n<p>Expectation from section :-</p>\r\n<p>- Rotating Trophy Based some Event (Section Based Event)</p>\r\n<p>- Best Volunteer award â€“ on the basis of the feedback from the event coordinator (on a specific form to be designed).</p>\r\n<p>- Projects For Humanitarian activities (Till now awareness in school)</p>\r\n<p>Â </p>\r\n<p>Starting initiative to be taken by Gujarat Section.</p>\r\n<p>Â </p>\r\n<p>Design Team</p>\r\n<p>Shirali,Hetaswi,Ankit,Prateek</p>\r\n<p>Â </p>\r\n<p>Editorial</p>\r\n<p>Aakriti,Parth,Pavas,Saumik,Atin,Nikhil,Shirali,Aman</p>\r\n<p>Â </p>\r\n<p>Food</p>\r\n<p>Anit,Anshul,Vedang</p>\r\n<p>Â </p>\r\n<p>Resource â€“ Purchase</p>\r\n<p>Anit,Razi</p>\r\n<p>Â </p>\r\n<p>Resouce Management</p>\r\n<p>Maullik,Poojan,Anshul,Nikhil,Ankit,Prateek</p>', '', 1, 0, 0, 39, '2011-03-18 23:03:40', 42, '', '2011-03-31 23:45:52', 42, 0, '0000-00-00 00:00:00', '2011-03-18 23:03:39', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 8, 0, 0, '', '', 1, 128, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
