(10, 55, 'Message from Counselor', 'message-from-counselor', '', '<p>Â </p>\r\n<div style="color: #333333; font-family: Tahoma, Helvetica, Arial, sans-serif; font-size: 76%; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: #ffffff; line-height: 1.3em; margin: 8px;">\r\n<p><br /> <br /></p>\r\n<table style="text-align: center;" border="0" width="541">\r\n<tbody>\r\n<tr>\r\n<td width="25%" valign="bottom">\r\n<p><img src="images/MSR.jpg" border="0" /></p>\r\n<h4>Dr.Mehul Raval</h4>\r\n<p class="rightTxt1">Branch Counselor<br /> mehul_raval@daiict.ac.in</p>\r\n</td>\r\n<td width="75%">\r\n<p class="MsoNormal" style="text-align: justify;"><span style="line-height: 18px; font-size: medium;">"I have always been intrigued by a question what is IEEE? Does IEEE exist locally? or it exists only as website and journals or transactions? Is it only a research organization? When I looked back and reflected on matter realized that â€œWEâ€- the set of volunteers is like a â€œlocal IEEEâ€ to the community around us. It is phenomenon of â€œlocal IEEEâ€ which brings feeling of togetherness and team spirit. All â€œIâ€™sâ€ (individuals) merge and become â€œWEâ€ (team) through IEEE. Thus It is really my pleasure and privilege as a volunteer to get associated with the best IEEE student branch under the Gujarat section"</span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 12pt; line-height: 115%;" lang="EN-US"><br /></span></p>\r\n</div>\r\n<p>Â </p>', '', 1, 0, 0, 11, '2011-03-18 23:11:37', 42, '', '2011-04-01 22:34:43', 42, 0, '0000-00-00 00:00:00', '2011-03-18 23:11:37', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 6, 0, 6, '', '', 1, 443, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(11, 56, 'Welcome to IEEE Student Branch, DA-IICT', 'about-studentbranch', '', '<p>Â </p>\r\n<p>DA-IICT is an academic institution promoted by the Dhirubhai Ambani Foundation and the Reliance Group, Â primarily aimed to impart Information and Communication Technology (ICT) education of international standards. Â Established amidst the lush green corridor of Gandhinagar, Gujarat, DA-IICT lives for furtherance of Â education,research, and training in ICT. DA-IICT commenced activities from August 2001. DA-IICT is a research Â led institute which houses world class facilities such well equipped labs with latest equipment and software, Â modern lecture theaters, a multi-cuisine canteen and on campus residence.<br /><br />The Institute of Electrical and Electronic Engineers Student Branch at DA-IICT endeavors to promote student awareness among students on the opportunities that exist in the field of electronics and electrical engineering. Our objective is to bridge the gap between industry and students studying in technology-related fields, while promoting and providing an intellectually stimulating university environment for the student body.<br /><br />IEEE Student Branch, DA-IICT aims to provide an intereactive platform for students to develop proffessional and technical abilities. Since the inception, it is successful in organizing various events with well defined objectives.</p>\r\n<p>Â </p>\r\n<p>upcoming event- i.Fest 2011 <a href="../ifest">visit site</a></p>', '', 1, 0, 0, 19, '2011-03-18 23:12:30', 42, '', '2011-09-07 00:01:01', 42, 0, '0000-00-00 00:00:00', '2011-03-18 23:12:30', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 14, 0, 0, '', '', 1, 20405, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(12, 57, 'New website', 'new-website', '', '<p>\r\n<div style="color: #333333; font-family: Tahoma, Helvetica, Arial, sans-serif; font-size: 76%; background-image: initial; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: #ffffff; line-height: 1.3em; margin: 8px;">\r\n<p>New website of IEEE Student Branch, DA-IICT has been uploaded.</p>\r\n</div>\r\n</p>', '', -2, 0, 0, 15, '2011-03-18 23:13:11', 42, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2011-03-18 23:13:11', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 1, 0, 0, '', '', 1, 0, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', '');
