(13, 58, 'Byelaws', 'by-laws', '', '<p>Â </p>\r\n<p style="text-align: left;">Article I. General</p>\r\n<p>1. The Executive Committee shall be selected by the nomination file by the members of the last yearâ€™s Volunteer Team (as on Dec 31), preferably in Jan. The Executive Committee comprises of:</p>\r\n<p>a) Chairperson</p>\r\n<p>b) Vice Chairperson</p>\r\n<p>c) Secretary</p>\r\n<p>d) Treasurer</p>\r\n<p>e) Webmaster</p>\r\n<p>2. A Volunteer Team of 10-12 members shall be elected for which election shall be conducted as far as possible in Jan every year. This team will be subjected to expand twice in a year to include newly joined active members in the team (selected by current Executive Committee members).</p>\r\n<p>3. Term of each Executive Committee and the Volunteer Team shall be at least one calendar year.</p>\r\n<p>Â </p>\r\n<p>Article II. Qualifications for being selected to an executive officer position</p>\r\n<p>All prospective executive officers must be an IEEE Student member.</p>\r\n<p>All prospective executive officers must be a member of the last Volunteer Team as on Dec 31.</p>\r\n<p>All prospective executive officers must be in good academic standing with the Institute (at least 6.0/10.0 CPI).</p>\r\n<p>All prospective executive officers from B-Tech course or Post Graduation course must have completed a minimum of three or one full semester (autumn or winter) at the Institute, respectively.</p>\r\n<p>Students of final semester are not eligible for nominations for aforementioned executive officer positions.</p>\r\n<p>Â </p>\r\n<p>Article III. Qualifications for being elected to a Volunteer Team member</p>\r\n<p>1. All prospective Volunteer Team members must be an IEEE Student member.</p>\r\n<p>2. All prospective Volunteer Team members must be in good academic standing with the Institute (at least 6.0/10.0 CPI).</p>\r\n<p>3. All prospective Volunteer Team members from B-Tech course or Post Graduation course must have completed a minimum of three or one full semester (autumn or winter) at the Institute, respectively.</p>\r\n<p>4. Students of final semester are not eligible for nominations for Volunteer Team member.</p>\r\n<p>5. A person can file nomination for only one post at a time.</p>\r\n<p>Â </p>\r\n<p>Article IV. Qualifications for being selected to a Volunteer Team member (Additionally to all the Requirements stated in Article III.)</p>\r\n<p>1. All prospective Volunteer Team members must have recently volunteered in at least two activities of the IEEE Student Branch, DA-IICT.</p>\r\n<p>Â </p>\r\n<p>Article V. Conduction of Volunteer Team memberâ€™s Elections</p>\r\n<p>At least one member of the last executive committee, who is not contesting for any post, shall preside at the Volunteer Team memberâ€™s elections, in the absence of fulfillment of this condition the branch counselor shall preside at the elections.</p>\r\n<p>Nominations for Volunteer Team members shall be made no more than one week prior to the elections at a general branch meeting.</p>\r\n<p>10 nominees with maximum votes will be declared as the member of the Volunteer Team.</p>\r\n<p>In case of tie up Branch counselor will have the final say.</p>\r\n<p>Â </p>\r\n<p>Article VI. Conduction of Executive Committee officerâ€™s selection</p>\r\n<p>The selection of the officers will be on the basis of the individual credit earned.</p>\r\n<p>The order of the selection will be Chair, Vice Chair, Secretary and Treasurer.</p>\r\n<p>In a general branch meeting all the members of the last Executive Committee and the Branch Counselor will give certain credits (on the scale of 10) to each competitor for each post.</p>\r\n<p>Nominee with maximum credit will be declared winner for that particular post.</p>\r\n<p>In case no one files nomination for any post/s then the Branch Counselor and the last Executive Committee will nominate a member/s from the last Volunteer Team (as on Dec 31) for that post/s.</p>\r\n<p>In case of tie up Branch counselor will have the final say.</p>\r\n<p>Â </p>\r\n<p>Article VII. Expansion of the Volunteer Team (twice a year)</p>\r\n<p>1. Every twice in a year(probably in April and November) nomination will be invited from the IEEE Student Branch member who are not the member of Volunteer Team.</p>\r\n<p>2. In a general branch meeting all the members of the Volunteer Team, Executive Committee and Branch Counselor will give certain credits(on the scale of 10) to each nominee.</p>\r\n<p>3. Nominee crossing the threshold of 6*total number of person giving credit will be declared as the new member of the Volunteer Team.</p>\r\n<p>4. In case no one able to cross the threshold then no expansion will be done.</p>\r\n<p>Â </p>\r\n<p>Article VIII. Nomination for additional positions</p>\r\n<p>1. The following positions would be filled at discretion of the branch counselor.</p>\r\n<p>a. Batch representative. (If IEEE members from a respective batch are more than 10, the branch counselor, the current Executive Committee and the current Volunteer Team would select the batch representative).</p>\r\n<p>Â </p>\r\n<p>Article IX. Inactivity/Expulsion from Volunteer team and Executive committee.</p>\r\n<p>1. The inactivity of a Volunteer/officer is defined as</p>\r\n<p>a. Not attending the branch meetings &amp; Showing disinterest in the branch affairs.</p>\r\n<p>b. Not performing the aforementioned duties.</p>\r\n<p>c. Not abiding by the constitution of the Team/Committee.</p>\r\n<p>d. Any kind of threatening behavior using the position of office-holder.</p>\r\n<p>2. Any Volunteer/officer is subject to expulsion by the Team/Committee on grounds of the aforementioned reasons.</p>\r\n<p>3. Expulsion may be initiated by any Team member or officer, by mailing to the Counselor.</p>\r\n<p>4. The Counselor will have to call an urgent branch meeting with in 3 working days of receiving such mail.</p>\r\n<p>5. The process of expulsion shall be carried out in the branch meeting. The member shall be expelled by a 2/3rd majority in the Team + Committee members (present in the meeting), with consent of Counselor.</p>\r\n<p>Â </p>\r\n<p>Article X. Officer Transition procedures</p>\r\n<p>All executive officers shall maintain a notebook recording their experiences for the academic year. This notebook should contain a written job description and a dynamic "best practices" document which records past program successes and failures.</p>\r\n<p>The secretary shall be responsible for maintaining a branch notebook, which must contain copies of the following documents:</p>\r\n<p>Annual plan</p>\r\n<p>Annual report</p>\r\n<p>Officer meeting minutes</p>\r\n<p>Attendance rosters for faculty presentations and general meetings.</p>\r\n<p>Counselor shall convene a general branch meeting within a week of announcement of the results for the elections and selections. The agenda of the meeting would be handing over of responsibilities to the newly selected executive committee and elected Volunteer member.</p>\r\n<p>Newly selected officers and elected Volunteer Team member shall take over office after this meeting.</p>\r\n<p>Outgoing officers shall then hand over their notebooks to the incoming officers.</p>\r\n<p>Chairman and Treasurer of the DA-IICT Student Branch shall be one of the authorized signatories along with the Branch Counselor for all financial matters and transactions.</p>\r\n<p>No product/service shall be hired/purchased on cash unless approved by above two of three authorized signatories.</p>\r\n<p>Chairman of branch shall be responsible for preparing Annual Plan for the branch. Draft of annual plan shall be prepared by September month for the coming year.</p>\r\n<p>Â </p>\r\n<p>Â </p>\r\n<p>Â </p>\r\n<p>Â </p>\r\n<p>* In case of any discrepancy Branch counselor decision will be final and binding to all.</p>\r\n<p>Â </p>\r\n<p>Â </p>', '', 1, 0, 0, 11, '2011-03-18 23:14:01', 42, '', '2011-03-31 20:58:16', 42, 0, '0000-00-00 00:00:00', '2011-03-18 23:14:01', '0000-00-00 00:00:00', '', '', '{