(20, 69, 'Tentative Events', 'tentative-events', '', '<p class="MsoNormal" style="text-align: center;"><strong><span style="text-decoration: underline;"><span style="font-size: 20pt; line-height: 115%;">Tentative Events in 2011</span></span></strong></p>\r\n<p class="MsoListParagraphCxSpFirst" style="margin-left: 0in;"><strong><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;"> </span></strong></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left: 31.5pt;"><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;"> </span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left: 31.5pt;"><strong><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;"> </span></strong></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left: 31.5pt; text-indent: -0.25in;"><strong><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;"><span>1.<span style="font: 7pt &quot;Times New Roman&quot;;"> </span></span></span></strong><strong><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;">One Day Workshop/Talk on Artificial Intelligence â€“ 19<sup>th</sup> February, 2011</span></strong></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left: 31.5pt;"><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;">To quest your thirst to make machines work like you. DA-IICT Student Branch brings one day workshop to start your footsteps in this direction.</span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left: 31.5pt; text-indent: -0.25in;"><strong><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;"><span>2.<span style="font: 7pt &quot;Times New Roman&quot;;"> </span></span></span></strong><strong><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;">Nano Technology Seminar</span></strong></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left: 31.5pt;"><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;">Through this seminar we would try to bring virtual aspect to the essence of Nano Science through videos and presentations</span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left: 31.5pt; text-indent: -0.25in;"><strong><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;"><span>3.<span style="font: 7pt &quot;Times New Roman&quot;;"> </span></span></span></strong><strong><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;">Robotics Competition</span></strong></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left: 31.5pt; text-align: justify;"><span><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; color: black;">This competition is an interesting game- cum- intellectual exercise for budding engineers and their enthusiastic instructors, determined to innovate and create machines for producing desired results</span></span><strong> </strong></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left: 31.5pt; text-indent: -0.25in;"><strong><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;"><span>4.<span style="font: 7pt &quot;Times New Roman&quot;;"> </span></span></span></strong><strong><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;">National Level Coding Competition</span></strong></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left: 31.5pt; text-align: justify;"><span><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; color: black;">Prove yourself in the test of not only skills, but also endurance and perseverance as you make your way through a series of problems equipped with C, C++ and Java as your tools.</span></span><strong> </strong></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin: 0in 0in 0.0001pt 31.5pt; text-indent: -0.25in; line-height: normal;"><strong><span style="font-size: 12pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;"><span>5.<span style="font: 7pt &quot;Times New Roman&quot;;"> </span></span></span></strong><strong><span style="font-size: 12pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;">Cloud Computing</span></strong></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin: 0in 0in 0.0001pt 31.5pt; text-align: justify; line-height: normal;"><span style="font-size: 12pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;">This workshop will attempt to cover matter relevant to giving Students and Professionals necessary knowledge and skill set to appreciate the rapidly changing scenario in Cloud Computing and take advantage of this in furthering their career.</span><strong> </strong></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left: 31.5pt; text-indent: -0.25in;"><strong><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;"><span>6.<span style="font: 7pt &quot;Times New Roman&quot;;"> </span></span></span></strong><strong><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;">Summer Research School</span></strong></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left: 31.5pt; text-align: justify;"><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;">IEEE Student Branch DA-IICT provides an opportunity to students interested in research to unite at one place. </span><span><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; color: black;">The objective of this Internship Opportunity, 2010 is to provide hands-on training to 1<sup>st</sup>/2<sup>nd </sup>year under-graduate in speech technology, data mining and information retrieval</span></span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left: 31.5pt; text-indent: -0.25in;"><strong><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;"><span>7.<span style="font: 7pt &quot;Times New Roman&quot;;"> </span></span></span></strong><strong><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;">Student Professional Awareness Conference</span></strong></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin: 0in 0in 0.0001pt 31.5pt; text-align: justify;"><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;">S-PACs are an effective vehicle to transmit the professional awareness that enhances the technical education they receive in engineering school. S-PACs permit students to learn from the varied experience of successful engineers.</span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left: 31.5pt; text-indent: -0.25in;"><strong><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;"><span>8.<span style="font: 7pt &quot;Times New Roman&quot;;"> </span></span></span></strong><strong><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;">i.fest</span></strong></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left: 31.5pt;"><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;">Continuing the Tradition to provide students with a platform to compete with their peers the i.fest is going to be bigger and better this year.</span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left: 0in;"><strong><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;"> </span></strong></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left: 31.5pt; text-indent: -0.25in;"><strong><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;"><span>9.<span style="font: 7pt &quot;Times New Roman&quot;;"> </span></span></span></strong><strong><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;">TEDx TALK</span></strong></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left: 31.5pt;"><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;">With the idea of spreading experience we bring the Tedx Talk combination of live presenters and videos to DA-IICT.</span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left: 0in;"><strong><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;"> </span></strong></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left: 0in;"><strong><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;"> </span></strong></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left: 31.5pt; text-indent: -0.25in;"><strong><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;"><span>10.<span style="font: 7pt &quot;Times New Roman&quot;;"> </span></span></span></strong><strong><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;">Open Source Code Hack</span></strong></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left: 31.5pt; text-align: justify;"><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;">Hands-on Code Hacking <span style="display: none;">HaHHHH</span>Session to motivate students to participate in open source development by KDE India Team.</span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left: 31.5pt; text-align: justify;"><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;"> </span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left: 31.5pt; text-indent: -0.25in;"><strong><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;"><span>11.<span style="font: 7pt &quot;Times New Roman&quot;;"> </span></span></span></strong><strong><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;"><span> </span>Two Day Workshop on High Speed Semiconductor Devices</span></strong></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left: 31.5pt;"><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;">This workshop purports to involve students in a cohesive drive with academia and industry towards excellence in High Speed VLSI</span><strong><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;"> </span></strong><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;">circuit Design.</span><strong> </strong></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left: 0in;"><strong><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;"> </span></strong></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left: 31.5pt; text-indent: -0.25in;"><strong><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;"><span>12.<span style="font: 7pt &quot;Times New Roman&quot;;"> </span></span></span></strong><strong><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;">Small Activities</span></strong><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;"> </span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left: 67.5pt; text-indent: -0.25in;"><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;"><span>a.<span style="font: 7pt &quot;Times New Roman&quot;;"> </span></span></span><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;">Tech Talk</span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left: 67.5pt; text-indent: -0.25in;"><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;"><span>b.<span style="font: 7pt &quot;Times New Roman&quot;;"> </span></span></span><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;">General Body Meeting of Branch Members of DA-IICT</span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left: 67.5pt; text-indent: -0.25in;"><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;"><span>c.<span style="font: 7pt &quot;Times New Roman&quot;;"> </span></span></span><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;">Invited Talks</span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left: 67.5pt; text-indent: -0.25in;"><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;"><span>d.<span style="font: 7pt &quot;Times New Roman&quot;;"> </span></span></span><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;">Planning Various Cultural Activities for Student Members round the year.</span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left: 0in;"><strong><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;"> </span></strong></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left: 0in;"><strong><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;">New Initiatives to be taken</span></strong></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left: 67.5pt; text-indent: -0.25in;"><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;"><span>a.<span style="font: 7pt &quot;Times New Roman&quot;;"> </span></span></span><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;">Special Interest Groups</span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left: 67.5pt; text-indent: -0.25in;"><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;"><span>b.<span style="font: 7pt &quot;Times New Roman&quot;;"> </span></span></span><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;">K-Sharing</span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left: 67.5pt; text-indent: -0.25in;"><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;"><span>c.<span style="font: 7pt &quot;Times New Roman&quot;;"> </span></span></span><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;">IEEE Sessions on Exploring IEEE Tools like Xplore, MemberNet, Webinar, Job Site, Webmail Alias</span></p>\r\n<p class="MsoListParagraphCxSpMiddle" style="margin-left: 67.5pt; text-indent: -0.25in;"><span style="font-size: 12pt; line-height: 115%; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;"><span>d.<span style="font: 7pt &quot;Times New Roman&quot;;"> </span></span></span><span style="font-size: 12pt; line-height: 115%; font-famil