(27, 76, 'IEEE Educational Activities', 'ieee-educational-activities', '', '<table style="height: 41px;" border="0" width="515" height="41">\r\n<tbody>\r\n<tr>\r\n<td width="80%" align="left">\r\n<h1>IEEE Educational Activities</h1>\r\n</td>\r\n<td align="right" valign="top"><br /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<div id="introContent">\r\n<p>The IEEE provides learning opportunities within the              engineering sciences, research and broadly, technology. The              goal of the IEEE education programs is to ensure the growth              of skill and knowledge among the technical             professionÂ and to  foster individual commitment to             continuing education among  IEEE members, the engineering and             scientific community, and  the general public.</p>\r\n<div class="introtext"><img src="http://ieee.org/portal/cms_docs_iportals/iportals/global/images/1px_868686.gif" border="0" hspace="0" vspace="0" width="100%" height="1" /></div>\r\n</div>\r\n<p>Â </p>\r\n<div id="moduleWrapper" style="position: relative; top: -10px;"><a> <br />\r\n<h2>IEEE Online Professional Development</h2>\r\n</a>\r\n<div class="moduleWrapperNoScroll">\r\n<table border="0" cellspacing="0" cellpadding="0" width="100%">\r\n<tbody>\r\n<tr>\r\n<td width="100%" valign="top"><span class="moduleText">\r\n<p>IEEE offers a broad range of online professional                     development both to members and non-members. <strong>IEEE</strong> <strong>Online Professional Development</strong> has been                     developed to serve as a central point to  identify                     opportunities offered by organizational  units. You                     will find online opportunities that cover                      technical topics as well as management and career                      planning activities. <strong> <a href="http://ieee.org/web/education/prodev/index.html">Learn more</a> </strong></p>\r\n</span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<a> <br />\r\n<h2>IEEE Professional Certification</h2>\r\n</a>\r\n<div class="moduleWrapperNoScroll">\r\n<table border="0" cellspacing="0" cellpadding="0" width="100%">\r\n<tbody>\r\n<tr>\r\n<td width="100%" valign="top"><span class="moduleText">\r\n<p>IEEE                     offers a number of professional  certification                     programs to both       members and  non-members.                         <strong>IEEE Professional       Certification</strong> offers professionals the opportunity to demonstrate                      their skills and knowledge, in a variety of                      technical fields, to their       employers, peers,                      and customers. <a href="http://ieee.org/web/education/professional_certification/index.html"> <strong>Learn More</strong> </a></p>\r\n</span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<a> <br />\r\n<h2>IEEE Expert Now â€” Earn CEUs and PDHs</h2>\r\n</a>\r\n<div class="moduleWrapperNoScroll">\r\n<table border="0" cellspacing="0" cellpadding="0" width="100%">\r\n<tbody>\r\n<tr>\r\n<td width="100%" valign="top"><span class="moduleText">\r\n<div class="moduletext">\r\n<p><strong>IEEE Expert Now</strong> is a series of engaging                          and highly interactive online learning courses                          based on the best IEEE educational tutorials                          and workshops from IEEE conferences around the                          world. These courses have been developed by                          recognized experts in a wide range of                          engineering and research technologies. <strong> <a href="http://ieee.org/web/education/Expert_Now_IEEE/index.html">Learn more</a> </strong></p>\r\n</div>\r\n</span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<a> <br />\r\n<h2>IEEE Education Partners Program (IEEE EPP)</h2>\r\n</a>\r\n<div class="moduleWrapperNoScroll">\r\n<table border="0" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td valign="top"><img src="http://ieee.org/portal/cms_docs_iportals/iportals/education/partners/images/EPPlogocolor.jpg" border="0" alt="IEEE EPP" width="150" height="75" /></td>\r\n<td width="15"><br /></td>\r\n<td valign="top"><span class="moduleText">\r\n<p>Through resources provided by the IEEE Education                      Partners Program (IEEE EPP), IEEE members can take                      continuing education, certificate and graduate                      degree courses from quality providers at up to a                          <strong>10% discount</strong>. <strong> <a href="http://www.ieee.org/web/education/partners/edupartners.html">Learn more</a> </strong></p>\r\n<p>Â </p>\r\n</span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<a> <br />\r\n<h2>IEEE Women In Engineering</h2>\r\n</a>\r\n<div class="moduleWrapperNoScroll">\r\n<table border="0" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td valign="top"><img src="http://ieee.org/portal/cms_docs_iportals/iportals/education/home/07SUPP0001_WIE_v2small.jpg" border="0" alt="IEEE WIE" /></td>\r\n<td width="15"><br /></td>\r\n<td valign="top"><span class="moduleText">\r\n<p>The mission of IEEE WIE is to inspire, engage,                      encourage, and empower IEEE women worldwide. WIE                      facilitates the development of programs that                     promote  the entry into and retention of women in                      engineering programs; administers the <a href="http://www.ieee.org/web/membership/women/star.html">IEEE                         Student-Teacher and Research Engineer/Scientist                         (STAR) Program</a> to mentor young women; and                     more.Â  <strong> <a href="http://www.ieee.org/women">Learn more</a> </strong></p>\r\n</span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<a> <br />\r\n<h2>TryEngineering.org</h2>\r\n</a>\r\n<div class="moduleWrapperNoScroll">\r\n<table border="0" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td valign="top"><img src="http://ieee.org/portal/cms_docs_iportals/iportals/education/preuniversity/TryenginDraftLogo.jpg" border="0" alt="TryEngineering logo" width="150" height="150" /></td>\r\n<td width="15"><br /></td>\r\n<td valign="top"><span class="moduleText">\r\n<p>The IEEE and IBM have created a new Web site that                      combines information on engineering careers with                      interactive activities.</p>\r\n<p>Intended for pre-university students, parents,                      teachers, school counselors, and the general public,                      TryEngineering.org lets visitors explore how to                      prepare for an engineering career, ask experts                      engineering-related questions, play interactive                      games, and more.</p>\r\n<p>Visit <a href="http://www.tryengineering.org/">www.tryengineering.org</a> today!</p>\r\n<p>Â </p>\r\n</span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<a> <br />\r\n<h2>IEEE Continuing Education Offerings</h2>\r\n</a>\r\n<div class="moduleWrapperNoScroll">\r\n<table border="0" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td valign="top"><span class="moduleText">\r\n<p>In the IEEE, education occurs at many levels.                      Educational Activities offers educational                      opportunities such as <a href="http://www.ieee.org/web/education/Expert_Now_IEEE/index.html">IEEE                         Expert Now</a>, the <a href="http://www.ieee.org/web/education/partners/eduPartners.html">Education                         Partners Program</a>, Â and <a href="http://www.ieee.org/web/education/standards/index.html">Education                         about Standards</a>. <a href="http://ieee.org/web/societies/home/index.html">IEEE                         Technical Societies</a> offer tutorials and                     short courses at conferences. <a href="http://ieee.org/web/geo_activities/home/index.html">Sections                         and Chapters</a> sponsor short courses and talks                     at meetings. You can learn more about the <a href="http://www.ieee.org/web/education/ceus/index.html">IEEE                         Continuing Education Units (CEU) Program</a>.                      Â Throughout the Institute, there are a wide                      range of courses and other educational activities                      which have been identifiedÂ in the <a href="http://ieee.org/web/education/prodev/index.html">IEEE                         Online Professional Development</a> web                     pages. <strong> <a href="http://www.ieee.org/web/education/Continuing_Education/index.xml">Learn more</a> </strong></p>\r\n</span></td>\r\n<td width="15"><br /></td>\r\n<td valign="top"><img src="http://ieee.org/portal/cms_docs_iportals/iportals/education/home/conted_updated.jpg" border="0" alt="courses" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<a> <br />\r\n<h2>IEEE Accreditation</h2>\r\n</a>\r\n<div class="moduleWrapperNoScroll">\r\n<table border="0" cellspacing="0" cellpadding="0" width="100%">\r\n<tbody>\r\n<tr>\r\n<td width="100%" valign="top"><span class="moduleText">\r\n<p>Accreditation is the means by which students,                      professionals, government bodies, and the general                      public know that a program or institution provides a                      quality education. The IEEE carries out the                      accreditation process with the Accreditation Board                      for Engineering and Technology, Inc. (ABET) for U.S.                      engineering and engineering technology programs. The                      IEEEÂ also participates in international                      accreditation activities. <a href="http://www.ieee.org/web/education/apc/index.html"> <strong>Learn more</strong> </a></p>\r\n</span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<a> <br />\r\n<h2>IEEE Pre-University Education</h2>\r\n</a>\r\n<div class="moduleWrapperNoScroll">\r\n<table border="0" cellspacing="0" cellpadding="0">\r\n<tbody>\r\n<tr>\r\n<td valign="top"><span class="moduleText">\r\n<p>If you are interested in exploring the exciting                      world of information technology, computer science,                      electrical, and electronics engineering, you have                      come to the right place. Created for engineers,                      educators, parents, students, IEEE volunteers and                      the public, this site offers many valuable                      resources. <a href="http://ieee.org/web/education/preuniversity/home.html"> <strong>Learn more</strong> </a></p>\r\n</span></td>\r\n<td width="15"><br /></td>\r\n<td valign="top"><img src="http://ieee.org/portal/cms_docs_iportals/iportals/education/preuniv.gif" border="0" alt="students" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<a> <br />\r\n<h2>IEEE Educational Activities Board</h2>\r\n</a>\r\n<div class="moduleWrapperNoScroll">\r\n<table border="0" cellspacing="0" cellpadding="0" width="100%">\r\n<tbody>\r\n<tr>\r\n<td width="100%" valign="top"><span class="moduleText">\r\n<p>The IEEE Educational Activities Board (EAB)                      recommends policies on educational matters and                      implements programs specifically intended to serve                      the educational pursuits of IEEE members, the                      engineering and scientific communities, and the                      general public. <a href="http://ieee.org/web/education/EABVolunteers/index.html"> <strong>Learn more</strong> </a></p>\r\n</span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n</div>', '', 1, 0, 0, 10, '2011-03-22 11:33:53', 42, '', '0000-00-00 00:00:00', 0, 42, '2011-03-28 05:05:57', '2011-03-22 11:33:53', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 1, 0, 4, '', '', 1, 204, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', '');
