(33, 82, 'Region 10 Outstanding Volunteer Award', 'region-10-outstanding-volunteer-award', '', '<h4><span style="font-weight: normal;">Dr. Anil Roy, Former Student Branch counselor of IEEE DA-IICT SB has been selected as a recipient of the 2010 Region 10 Outstanding Volunteer Award</span></h4>', '', 1, 0, 0, 15, '2011-03-22 11:45:22', 42, '', '2011-03-31 21:01:36', 42, 0, '0000-00-00 00:00:00', '2011-03-22 11:45:22', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 2, 0, 9, '', '', 1, 197, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(34, 83, 'Result of R10 Website Competition 2010', 'results-of-r10-website-competition', '', '<p>DA-IICT Student Branch has got 1st prize in IEEE R10 website competition.</p>\r\n<p><a href="http://ewh.ieee.org/reg/10/Announcements/files/2010StudentWebContest.html" target="_new">http://ewh.ieee.org/reg/10/Announcements/files/2010StudentWebContest.html</a></p>', '', 0, 0, 0, 15, '2011-03-22 11:46:52', 42, '', '2011-11-05 06:11:01', 42, 0, '0000-00-00 00:00:00', '2011-03-22 11:46:52', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 5, 0, 8, '', '', 1, 177, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(35, 84, 'Two day workshop on Embedded Systems', 'two-day-workshop-on-embedded-systems', '', '<p>A two day workshop on Embedded Systems organised by Industry Applications Society(IAS) and IEEE Gujarat Section.</p>\r\n<p>For more details visit <a href="http://ieee.daiict.ac.in/embedded" target="_blank">http://ieee.daiict.ac.in/embedded</a></p>', '', 0, 0, 0, 15, '2011-03-22 11:47:28', 42, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2011-03-22 11:47:28', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 1, 0, 7, '', '', 1, 1, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(36, 85, 'WIE', 'wie', '', '<h1 style="text-align: center;"><strong><span style="font-size: 12pt;">IEEE WIE, affinity Group</span></strong><span style="font-size: 12pt;"> </span></h1>\r\n<p>Â </p>\r\n<p class="MsoNormal"><img src="images/wie.jpg" border="0" />WIE is largest international professional group  dedicated to promoting women engineers and scientist. The idea is to  provide the young women with a platform, encouragement and inspiration  to come up with confidence and excellence in the technical career of  Engineering.WIE is an effort to motivate the women to be a part of  science, Technology and Engineering by bringing all men and women with  such ambitions to put a joint effort towards this.</p>\r\n<p>Â </p>\r\n<p class="MsoNormal"><strong>IEEE aims to achieve this by taking following steps:</strong></p>\r\n<p>Â </p>\r\n<p class="MsoNormal"><span> </span></p>\r\n<ul style="margin-top: 0in;" type="disc">\r\n<li class="MsoNormal"><span>Recognizing their achievements in electrical and electronics engineering      through IEEE awards.</span></li>\r\n<li class="MsoNormal"><span>Promoting WIE at major technical  conferences. We have also taken a few      initiatives like discounts in  membership for girls in order to increase      the number of  participants.</span></li>\r\n<li class="MsoNormal"><span>Advocate women in leadership roles in IEEE governance, providing      assistance and support to the activities of these groups.</span></li>\r\n<li class="MsoNormal"><span>Facilitating programs and activities for  promoting girlsâ€™      participation. We are planning to organize an  interactive session by two      of our seniors who were selected in  Google, women of India contest.</span></li>\r\n<li class="MsoNormal"><span>Administering the STAR program to mentor young women in junior and      high schools.</span></li>\r\n<li class="MsoNormal">IEEE student branch is      looking forward to  deliver few lectures to the school students of      Gandhinagar and  Ahmadabad in order to inspire girls to take up engineering      as a  career.</li>\r\n</ul>\r\n<p>Â </p>\r\n<p>Â </p>\r\n<p><strong>WIE at DA-IICT: Journey so far</strong></p>\r\n<p>Â </p>\r\n<p>DA-IICT IEEE Student branch too has a â€œWomen in Engineering Affinity Groupâ€ which was established in 2009. In its first year of existence, WIE organized a workshop on â€œDigital Image Processingâ€ offering rebate to girls attending the workshop. The event saw an improved participation of girls not only from DA-IICT but also from other student branches.</p>\r\n<p>DA-IICT WIE group had applied for the above mentioned grants for the year 2010 and had been granted the Sangammam Fund for humanitarian activities. The activities planned on the humanitarian front included a visit to a local school â€œKadi Schoolâ€ on 23rd September, 2010 to counsel the senior students on the career opportunities they could consider after finishing secondary school. On the other hand, WIE at DA-IICT organized an invited talk by the members of SEWA (â€œSelf Employed Womenâ€™s Associationâ€, an NGO based in Ahmedabad, Gujarat) on the 25th September, 2010 during â€œi.festâ€ (DA-IICTâ€™s annual inter-college technical fest organized by the IEEE Student branch). The speakers from SEWA talked about the way rural Indian women are being assisted in learning the applications of ICT in their daily lives to make a living and become independent.</p>\r\n<p>This year, we intend to take WIE at a different platform by targeting national participation and helping other IEEE student branches establish WIE affinity groups. Among the various initiatives that the WIE 2011-2012 executive committee intends to take is that of K-sharing or Knowledge sharing. It is live video conferencing with professors, scientists and researchers from other organizations and institutes. WIE Executive Committee hopes to provide benefits of k-sharing to students in rural setup as well.</p>\r\n<p>Â </p>\r\n<p>Â </p>\r\n<p>Â </p>\r\n<p>Â </p>', 