(37, 86, 'Workshop on Ethical Hacking', 'workshop-on-ethical-hacking', '', '<p><span style="line-height: 16px; border-collapse: collapse;"> </span></p>\r\n<h3 style="font-family: Helvetica,Arial,sans-serif; font-weight: bold; padding-bottom: 5px; font-size: 13px; color: #135cae;"><strong>IEEE Student Branch, DA-IICT brings you one day workshop on Ethical Hacking and Information Security.</strong></h3>\r\n<p><span style="font-family: Arial,Helvetica,sans-serif; font-weight: bold;">For more details visitÂ <span style="color: #5b5648; font-family: ''Lucida Grande'',Tahoma,Helvetica,sans-serif; line-height: 16px; font-size: 13px; border-collapse: collapse;"><a href="http://ieee.daiict.ac.in/ifest2010/loophole" target="_blank">http://ieee.daiict.ac.in/ifest2010/loophole</a></span></span></p>', '', 0, 0, 0, 15, '2011-03-22 11:49:42', 42, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2011-03-22 11:49:42', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 1, 0, 6, '', '', 1, 2, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
