(43, 96, 'Minutes of meeting: 27th March', 'minutes-of-meeting-27th-march', '', '<p><span style="font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 11px; line-height: normal;">\r\n<p style="font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 11px; text-align: left; line-height: 16px; padding: 0px; margin: 0px;">Minutes of meeting: 27th March</p>\r\n<p style="font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 11px; text-align: left; line-height: 16px; padding: 0px; margin: 0px;">AI Publicity Meeting</p>\r\n<p style="font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 11px; text-align: left; line-height: 16px; padding: 0px; margin: 0px;">Â </p>\r\n<p style="font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 11px; text-align: left; line-height: 16px; padding: 0px; margin: 0px;">1 . Publicity for AI</p>\r\n<p style="font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 11px; text-align: left; line-height: 16px; padding: 0px; margin: 0px;">PDPU â€“ gaurav, aman</p>\r\n<p style="font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 11px; text-align: left; line-height: 16px; padding: 0px; margin: 0px;">LDRP and IIT â€“G â€“ atin, anshul, mayank</p>\r\n<p style="font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 11px; text-align: left; line-height: 16px; padding: 0px; margin: 0px;">Nirma â€“ Kedar, anit</p>\r\n<p style="font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 11px; text-align: left; line-height: 16px; padding: 0px; margin: 0px;">Vidhanagar â€“ Prateek, aman</p>\r\n<p style="font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 11px; text-align: left; line-height: 16px; padding: 0px; margin: 0px;">Also wing wise publicity to be done</p>\r\n<p style="font-family: ''lucida grande'', tahoma, verdana, ar