(44, 97, 'Student Branch Activities', 'sba1', '', '<p>Â </p>\r\n<h4>SIG(SPECIAL INTEREST GROUP)</h4>\r\n<p>What is SIG?</p>\r\n<p>A group of students who have a common interest, work towards a specific goal/project or just share their knowledge in the subject. You get to increase your knowledge base, get experience of working on projects, and interact with faculty and seniors. It is an ongoing process and there would be meetings throughout the semester.</p>\r\n<p>Three groups are planned</p>\r\n<p>â€“ SIG Embedded systems</p>\r\n<p>â€“ SIG Mathematics</p>\r\n<p>â€“ SIG Programming</p>\r\n<p>Â </p>\r\n<p>SIG EMBEDDED SYSTEMS:</p>\r\n<p>Learn about programming a micro-controller, different ICâ€™s sensors, interfaces used in today have embedded systems.</p>\r\n<p>Group Project: Get hands on experience in programming, hardware interface and pcb making.</p>\r\n<p>Meet the Geeks: People talk about what they worked on in the last month. Keeps everyone motivated.</p>\r\n<p>Â </p>\r\n<p>SIG PROGRAMMING</p>\r\n<p>Hack Days: A group hack session where you are supposed to build whatever you want. A prize at the end of the day to the best.</p>\r\n<p>Small individual Projects</p>\r\n<p>Meet the Geeks: People talk about what they worked on in the last month. Keeps everyone motivated.</p>\r\n<p>Â </p>\r\n<p>SIG MATHEMATICS:</p>\r\n<p>A lot of research work in computer science, signal processing, computer vision, algorithms is perused through mathematics. So it does make sense to promote student interest in applied mathematics.</p>\r\n<p>Â </p>\r\n<p>Â </p>\r\n<h4>K-SHARING:</h4>\r\n<p>K stands for â€œKnowledgeâ€. K-sharing is a synonym to video conferencing. Not every time can we expect highly honoured professors and industrialists give a speech on a technical topic, but K sharing is a feasible way to achieve this. We have professors from universities in and outside India giving lectures over Skype .Certain industrialists also share their practical experiences from wherever they are over video conferencing.</p>\r\n<p>Â </p>', '', 1, 0, 0, 11, '2011-03-29 08:28:17', 42, '', '2011-03-31 22:08:37', 42, 0, '0000-00-00 00:00:00', '2011-03-29 08:28:17', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 9, 0, 0, '', '', 1, 306, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
