(47, 100, 'Minutes of meeting 10th Feb', 'minutes-of-meeting-10th-feb', '', '<p>\r\n<p class="MsoNormal"><span style="font-family: ''Times New Roman'', serif;">\r\n<p class="MsoNormal"><span style="font-family: &quot;Times New Roman&quot;,&quot;serif&quot;;" lang="EN-US">IEEE Student Branch, DA-IICT</span></p>\r\n<p class="MsoNormal"><span style="font-family: &quot;Times New Roman&quot;,&quot;serif&quot;;" lang="EN-US">Minutes of Meeting,<span style="mso-spacerun: yes;"> </span>10<sup>th</sup> Feb, 2011, IEEE Room</span></p>\r\n<p class="MsoNormal"><span style="font-family: &quot;Times New Roman&quot;,&quot;serif&quot;;" lang="EN-US"> </span></p>\r\n<p class="MsoNormal"><span style="font-family: &quot;Times New Roman&quot;,&quot;serif&quot;;" lang="EN-US">Agenda: Special Interest Group and various issues</span></p>\r\n<p class="MsoNormal" style="margin-bottom: .0001pt; line-height: 12.0pt;"><span style="font-family: &quot;Times New Roman&quot;,&quot;serif&quot;; mso-fareast-font-family: &quot;Times New Roman&quot;; color: #333333;" lang="EN-US">Recorded by: Darsh Shah</span></p>\r\n<p class="MsoNormal"><span style="font-family: &quot;Times New Roman&quot;,&quot;serif&quot;;" lang="EN-US"> </span></p>\r\n<p style="margin: 0cm; margin-bottom: .0001pt; line-height: 12.0pt;"><span style="font-size: 11.0pt; color: #333333;" lang="EN-US">Major issues discussed:</span></p>\r\n<p style="margin: 0cm; margin-bottom: .0001pt; line-height: 12.0pt;"><span style="font-size: 11.0pt; color: #333333;" lang="EN-US"> </span></p>\r\n<p style="margin: 0cm; margin-bottom: .0001pt; line-height: 12.0pt;"><span style="font-size: 11.0pt; color: #333333;" lang="EN-US">1. Merge OSID and Programming SIG ? - discussion to be continued in next meeting</span></p>\r\n<p style="margin: 0cm; margin-bottom: .0001pt; line-height: 12.0pt;"><span style="font-size: 11.0pt; color: #333333;" lang="EN-US"> </span></p>\r\n<p style="margin: 0cm; margin-bottom: .0001pt; line-height: 12.0pt;"><span style="font-size: 11.0pt; color: #333333;" lang="EN-US">2. Start a communication lecture series and if successful, convert it to SIG. â€“ it is currently at low priority.</span></p>\r\n<p style="margin: 0cm; margin-bottom: .0001pt; line-height: 12.0pt;"><span style="font-size: 11.0pt; color: #333333;" lang="EN-US"> </span></p>\r\n<p style="margin: 0cm; margin-bottom: .0001pt; line-height: 12.0pt;"><span style="font-size: 11.0pt; color: #333333;" lang="EN-US">3.<span style="mso-spacerun: yes;"> </span>Special Interest groups team leaders:</span></p>\r\n<p style="margin: 0cm; margin-bottom: .0001pt; line-height: 12.0pt;"><span style="font-size: 11.0pt; color: #333333;" lang="EN-US"> </span></p>\r\n<p style="margin: 0cm; margin-bottom: .0001pt; line-height: 12.0pt;"><span style="font-size: 11.0pt; color: #333333;" lang="EN-US">Programming SIG - gaurav and aman</span></p>\r\n<p style="margin: 0cm; margin-bottom: .0001pt; line-height: 12.0pt;"><span style="font-size: 11.0pt; color: #333333;" lang="EN-US"> </span></p>\r\n<p style="margin: 0cm; margin-bottom: .0001pt; line-height: 12.0pt;"><span style="font-size: 11.0pt; color: #333333;" lang="EN-US"><span style="mso-spacerun: yes;"> </span>Math SIG group - anit</span></p>\r\n<p style="margin: 0cm; margin-bottom: .0001pt; line-height: 12.0pt;"><span style="font-size: 11.0pt; color: #333333;" lang="EN-US"> </span></p>\r\n<p style="margin: 0cm; margin-bottom: .0001pt; line-height: 12.0pt;"><span style="font-size: 11.0pt; color: #333333;" lang="EN-US"><span style="mso-spacerun: yes;"> </span>Embedded Systems SIG - parth and poojan</span></p>\r\n<p style="margin: 0cm; margin-bottom: .0001pt; line-height: 12.0pt;"><span style="font-size: 11.0pt; color: #333333;" lang="EN-US"> </span></p>\r\n<p style="margin: 0cm; margin-bottom: .0001pt; line-height: 12.0pt;"><span style="font-size: 11.0pt; color: #333333;" lang="EN-US">Rules and functioning of SIG:</span></p>\r\n<p style="margin: 0cm; margin-bottom: .0001pt; line-height: 12.0pt;"><span style="font-size: 11.0pt; color: #333333;" lang="EN-US"> </span></p>\r\n<p style="margin-top: 0cm; margin-right: 0cm; margin-bottom: .0001pt; margin-left: 18.0pt; text-indent: -18.0pt; line-height: 12.0pt; mso-list: l0 level1 lfo1;"><span style="font-size: 11.0pt; color: #333333;" lang="EN-US"><span style="mso-list: Ignore;">1.<span style="font: 7.0pt &quot;Times New Roman&quot;;"> </span></span></span><span style="font-size: 11.0pt; color: #333333;" lang="EN-US">A single student cannot be participated in more than 2 SIG. Initial lectures are free but then nominal fees for non ieee members</span></p>\r\n<p style="margin: 0cm; margin-bottom: .0001pt; line-height: 12.0pt;"><span style="font-size: 11.0pt; color: #333333;" lang="EN-US"> </span></p>\r\n<p style="margin-top: 0cm; margin-right: 0cm; margin-bottom: .0001pt; margin-left: 18.0pt; text-indent: -18.0pt; line-height: 12.0pt; mso-list: l0 level1 lfo1;"><span style="font-size: 11.0pt; color: #333333;" lang="EN-US"><span style="mso-list: Ignore;">2.<span style="font: 7.0pt &quot;Times New Roman&quot;;"> </span></span></span><span style="font-size: 11.0pt; color: #333333;" lang="EN-US">SIG- should perform to some objective and has a defined motto. Its progress will be evaluated after specific time. </span></p>\r\n<p style="margin: 0cm; margin-bottom: .0001pt; line-height: 12.0pt;"><span style="font-size: 11.0pt; color: #333333;" lang="EN-US"> </span></p>\r\n<p style="margin: 0cm; margin-bottom: .0001pt; line-height: 12.0pt;"><span style="font-size: 11.0pt; color: #333333;" lang="EN-US"> </span></p>\r\n<p style="margin: 0cm; margin-bottom: .0001pt; line-height: 12.0pt;"><span style="font-size: 11.0pt; color: #333333;" lang="EN-US">Other announcements:</span></p>\r\n<p style="margin: 0cm; margin-bottom: .0001pt; line-height: 12.0pt;"><span style="font-size: 11.0pt; color: #333333;" lang="EN-US"> </span></p>\r\n<p style="margin: 0cm; margin-bottom: .0001pt; line-height: 12.0pt;"><span style="font-size: 11.0pt; color: #333333;" lang="EN-US">1. Best volunteer award or kind of thing which will motivate volunteers to work</span></p>\r\n<p style="margin: 0cm; margin-bottom: .0001pt; line-height: 12.0pt;"><span style="font-size: 11.0pt; color: #333333;" lang="EN-US"> </span></p>\r\n<p style="margin: 0cm; margin-bottom: .0001pt; line-height: 12.0pt;"><span style="font-size: 11.0pt; color: #333333;" lang="EN-US">2. Everyone has to compulsorily comment on FB regarding events and other updates</span></p>\r\n<p style="margin: 0cm; margin-bottom: .0001pt; line-height: 12.0pt;"><span style="font-size: 11.0pt; color: #333333;" lang="EN-US"> </span></p>\r\n<p style="margin: 0cm; margin-bottom: .0001pt; line-height: 12.0pt;"><span style="font-size: 11.0pt; color: #333333;" lang="EN-US">3. Special seats for 2 Mtech students in IEEE execom/volunteer so that participation increases from that side</span></p>\r\n<p style="margin: 0cm; margin-bottom: .0001pt; line-height: 12.0pt;"><span style="font-size: 11.0pt; color: #333333;" lang="EN-US"> </span></p>\r\n</span></p>\r\n</p>', '', 1, 0, 0, 25, '2011-03-29 08:47:44', 42, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2011-03-29 08:47:44', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 1, 0, 3, '', '', 1, 101, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(48, 101, 'Sensor Network Workshop-10th April', 'sensor-network-workshop', '', '<p>Â </p>\r\n<p>Tasks that were earlier considered either impossible or rather tough have been made possible by the use of sensors today. These devices have innumerable applications right from weather forecasting (humidity sensors, pressure sensors, etc) to robotic applications; sensors have become an integral part of any automated detection system. Biosensors, accelerometers, gyrosensors, humidity sensor, acoustic sensors, pH sensors, Oxygen sensors, nanosensors, are some of the many sensors available.</p>\r\n<p>WIE, the ''Women In Engineering'' affinity group of the IEEE Student Branch of DA-IICT, brings Â an opportunity for you to learn about these field of study , its future and ongoing work through lecture series and a demo session.</p>\r\n<p>http://ieee.daiict.ac.in/sensornetwork</p>', '', 1, 0, 0, 42, '2011-03-29 09:10:08', 42, '', '2011-05-23 11:41:22', 42, 0, '0000-00-00 00:00:00', '2011-03-29 09:10:08', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 10, 0, 2, '', '', 1, 167, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(49, 102, 'Synposium on Artificial Intelligence-3rd April', 'artificial-intelligence', '', '<p>Â </p>\r\n<p>Artificial Intelligence or popularly called as AI has emerged as a topic of interesting research and still there are many untouched frontiers in the field. Artificial Intelligence is all about making machines and processes more intelligent and efficient. For instances Google should give more accurate and relevant results, Facebook should find friends more effectively, Trains should not collide, Robot should be able to work harmonically with humans and able to not just follow human instruction but can suggest to humans, and can hardware circuits behave and think logically like humans, can "Watson( IBM Supercomputer)" beat human intelligence every time it runs, can "Blue Gene" replicate our Nervous System or any living organism''s neural network. Will machine be ever able to understand human fully and incorporate intelligence and learn by themselves.</p>\r\n<p><a href="../ai" target="_blank" style="color: #0000cc; text-decoration: underline; font-weight: normal;">Visit Site</a></p>', '', 1, 0, 0, 42, '2011-03-29 09:11:48', 42, '', '2011-05-23 11:40:15', 42, 0, '0000-00-00 00:00:00', '2011-03-29 09:11:47', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 6, 0, 1, '', '', 1, 179, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', '');
