(58, 117, 'Minutes of meeting 2nd Feb', 'minutes-of-meeting-2nd-feb', '', '<p>\r\n<p>\r\n<p>\r\n<p>Minutes of meeting held on 2 - 3 - 2011</p>\r\n<p>Attendees: All executive committee members</p>\r\n<p>Meeting called by: Branch chair - Gaurav Arora</p>\r\n<p>Minutes noted by: Joint Secretary - Aakriti Gupta</p>\r\n<p>Agendas and action items are as follows:</p>\r\n<p>Agenda 1:</p>\r\n<p>Discussion on Workshop on Sensor Networks to be held on 10th April</p>\r\n<p>1. Contact the following:</p>\r\n<p>a. Professor Laxminarayan Pillutla - Megha, Aakriti</p>\r\n<p>Topic: Contents of workshop - Sensor networks</p>\r\n<p>b. Professot Prabhat Ranjan - Hetaswi, Shirali</p>\r\n<p>c. Professor Sanjay Srivastava. - Hetaswi</p>\r\n<p>Agenda 2:</p>\r\n<p>Discussion on KSharing:</p>\r\n<p>Megha to document the details discussed so far.</p>\r\n<p>Agenda 3:</p>\r\n<p>Resources for the IEEE Room</p>\r\n<p>1. Darsh: Mail Professor Mehul Raval regarding requirements of the IEEE room.</p>\r\n<p>a. Chairs - 25</p>\r\n<p>b. Details of the printer - Canon/HP - Inkjet Printer</p>\r\n<p>c. Table to be repaired - 1</p>\r\n<p>d. Tables to be replaced - 2</p>\r\n<p>Agenda 4:</p>\r\n<p>Discussion on Summer school -</p>\r\n<p>1. Living with machines</p>\r\n<p>a. Ravi discussed his research on Living With machines.</p>\r\n<p>b. Collaborate with NIRMA/another institute if we want to focus on Robotics?</p>\r\n<p>c. Name will be changed.</p>\r\n<p>2. Mobile Research:</p>\r\n<p>a. Aman to submit tentative structure tonight.3. Designing:</p>\r\n<p>a. Drasti/Namrata to submit tentative structure by tonight.</p>\r\n<p>Internet access for participants?</p>\r\n<p>Agenda 5:</p>\r\n<p>Discussion on Artificial Intelligence Symposium:</p>\r\n<p>1. Atin gave a report.</p>\r\n<p>2. Speakers to be finalized.</p>\r\n<p>Agenda 6:</p>\r\n<p>Special Interest Groups:</p>\r\n<p>1. 4 projects of NIF - to be mentioned during SIG meetings.</p>\r\n<p>Agenda 7:</p>\r\n<p>Other important announcements</p>\r\n<p>1. Everyone check if IEEE folder on the PDC is accessible</p>\r\n<p>2. Everyone send your photographs.</p>\r\n<p>3. Raagi - Complete Annual plan/report</p>\r\n<p>4. Vishrut to start with blogs tomorrow!</p>\r\n</p>\r\n</p>\r\n</p>', '', 1, 0, 0, 25, '2011-03-30 08:43:18', 42, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2011-03-30 08:43:18', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 1, 0, 1, '', '', 1, 108, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(59, 118, 'Minutes of meeting 2nd March ', 'minutes-of-meeting-2nd-march', '', '<p>\r\n<p>Minutes of meeting held on 2 - 3 - 2011</p>\r\n<p>Attendees: All executive committee members</p>\r\n<p>Meeting called by: Branch chair - Gaurav Arora</p>\r\n<p>Minutes noted by: Joint Secretary - Aakriti Gupta</p>\r\n<p>Agendas and action items are as follows:</p>\r\n<p>1. Dates, co-ordinators and volunteers for the events were</p>\r\n<p>finalized.</p>\r\n<p>2. Action Items:</p>\r\n<p>Summer School: Proposal of structure to be submitted by 28 February, 2011 for each of the</p>\r\n<p>following tracks:</p>\r\n<p>Track Person in-charge</p>\r\n<p>Living With Machines Ravi</p>\r\n<p>Mobile research Prateek</p>\r\n<p>Designing Namrata</p>\r\n<p>Content of brochure to be submitted by 2nd March by Megha.</p>\r\n<p>Resource Management team: Smit, Sahib, Vishrut</p>\r\n<p>To submit a report on the available resources and those to be bought in bulk by next Friday,</p>\r\n<p>4th March.</p>\r\n<p>Data organization(IEEE folder in daiictpdc) : Shubham, Gaurav</p>\r\n<p>1st session of SIG, Embedded Systems on Wednesday,23rd February, at 7:15 p.m.</p>\r\n<p>Demo of RF communication and radio, DA-IICT: Team will talk to Sir on Tuesday and</p>\r\n<p>report exact details by Tuesday night (22nd February).</p>\r\n<p>Website: Nirmal, Yashesh, Vivek</p>\r\n<p>Team to submit proposal for website up gradation (discussion forum, etc.) by 3rd March,</p>\r\n<p>Thursday.Designing of letterhead and receipt of membership form to be done by Prateek.</p>\r\n<p>Awards:</p>\r\n<p>Shubham to get the poster for publicizing the humanitarian award by the Bangalore Section</p>\r\n<p>reviewed tonight.</p>\r\n<p>Blog: Vishrut</p>\r\n<p>Start it by next week.</p>\r\n<p>Membership drive: Prateek</p>\r\n<p>how this has to be carried out!!</p>\r\n<p>Formal photos for ID cards to be sent to ankitgupta039@gmail.com by Wednesday, 2nd</p>\r\n<p>March.</p>\r\n</p>', '', 1, 0, 0, 25, '2011-03-30 08:44:33', 42, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2011-03-30 08:44:33', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 1, 0, 0, '', '', 1, 134, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(60, 119, 'ieeetv', 'ieeetv', '', '<p><a href="http://ieeetv.ieee.org" target="_new" style="color: #0000cc; text-decoration: underline; font-weight: normal;"><img class="caption" src="images/6_clip_image001.jpg" border="0" title="IEEE TV" style="border: 0px initial initial;" /></a></p>', '', 1, 0, 0, 33, '2011-03-30 09:05:46', 42, '', '2011-03-30 09:13:19', 42, 0, '0000-00-00 00:00:00', '2011-03-30 09:05:46', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 2, 0, 1, '', '', 1, 0, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(61, 120, 'ieeeexplore', 'ieeeexplore', '', '<p>Â </p>\r\n<p>Â </p>\r\n<p><a href="http://ieeexplore.ieee.org" target="_new" style="color: #1b57b1; text-decoration: none; font-weight: normal;"><img class="caption" src="images/6_clip_image001.gif" border="0" title="IEEE Explore" style="border: 0px initial initial;" /></a></p>', '', 1, 0, 0, 34, '2011-03-30 09:09:14', 42, '', '2011-04-01 20:41:45', 42, 0, '0000-00-00 00:00:00', '2011-03-30 09:09:14', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 6, 0, 0, '', '', 1, 0, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(62, 123, 'Future Plans', 'future-plans-wie', '', '<p><strong>Events Planned for the year 2011-2012(Apart from â€˜Sensor Networksâ€™ workshop)</strong></p>\r\n<p>1. <strong>K-Sharing</strong>: . It is live video conferencing with professors, scientists and researchers from other organizations and institutes.</p>\r\n<p>Â </p>\r\n<p>2. <strong>Workshop on â€˜High speed Semiconductorsâ€™</strong>: This would be a two-day workshop that would be a meeting point for the most eminent people in the field of VLSI design. The workshop would focus on paper presentations by students as well as professors and researchers from other institutes in the field of VLSI. The motivation is to find semiconductor solutions.</p>\r\n<p>Â </p>\r\n<p>3. <strong>Teaching with the aid of computers and other multimedia devices</strong>: This would essentially be an extension of K-sharing in the rural setup.</p>\r\n<p>Â </p>\r\n<p>4. <strong>Help other institutes establish WIE affinity groups</strong>: Spreading awareness about the importance of WIE is very essential because a community cannot sustain by itself. No event achieves its feat unless it benefits a larger mass. This would thus, be our small step towards increasing not only girlsâ€™ participation from other colleges but also helping them carry out similar activities.</p>\r\n<p>Â </p>\r\n<p>5. <strong>Paper Presentation</strong>: This would be a confluence of eminent women in the field of engineering. A paper presentation contest with women from technical institutes and organizations on the judging panel. This event is meant to encourage students for research and acknowledge and appreciate the work they have done.</p>\r\n<p>Â </p>\r\n<p>6. <strong>A quarterly WIE magazine</strong>: The magazine would highlight various opportunities for women and achievements of women. Besides it would also include articles on past events by IEEE and the then upcoming events.</p>', '', 1, 0, 0, 24, '2011-03-31 18:03:42', 42, '', '2011-08-04 08:45:07', 42, 0, '0000-00-00 00:00:00', '2011-03-31 18:03:42', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 7, 0, 4, '', '', 1, 379, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(63, 124, 'Awards and Funds', 'awards-funds-wie', '', '<p><strong><span style="text-decoration: underline;">2010 WIE Affinity Group of the Year</span>:</strong> The IEEE SB DA-IICT won this award for the activities conducted by the  Women In Engineering(WIE) wing in the year 2010. Activities on both the  humanitarian and technical front were conducted.<br /><br /><strong><span style="text-decoration: underline;">Congress Support Fund</span>:</strong> This fund has been given for WIE Congress 2011.<br /><br /><strong><span style="text-decoration: underline;">Darrel Chong Award:</span></strong> The Digital Image Processing Workshop conducted in March, 2009 won the Darrel Chong Student Activity Award.</p>\r\n<p><span style="text-decoration: underline;"><strong>Sangamam Fund: </strong></span>The humanitarian activities conducted in the year 2010 received Region 10 Sangamam Fund.</p>\r\n<p>Â </p>', '', 1, 0, 0, 24, '2011-03-31 18:06:30', 42, '', '2011-09-19 17:06:42', 42, 0, '0000-00-00 00:00:00', '2011-03-31 18:06:30', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 3, 0, 3, '', '', 1, 329, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(64, 127, 'About DA-IICT', 'about-da-iict', '', '<p><span style="font-family: Verdana; line-height: 20px;"> </span></p>\r\n<p>Â </p>\r\n<p>DA-IICT at Gandhinagar represents Wave-4 of educational innovation in Gujarat.</p>\r\n<p>The first wave was the nationalist wave and led to Gandhian experiments in education including Nai Talim. The Gujarat Vidyapith established in 1920 was a hybrid model of a university based on Gandhian principles.</p>\r\n<p>The second wave led to the establishment of a whole range of educational institutions in Gujarat, mainly private colleges</p>\r\n<p>The third wave, an inspired one, was spearheaded by the industrialist Kasturbhai Lalbhai and the scientist Vikram Sarabhai and led to the establishment of a network of national institutes of international renown. A whole array of remarkable intellectuals provided the leadership of these institutes.</p>\r\n<p>It was in Wave 4 when the focus shifted to higher education and private participation. One of the institutes created during this period is DA-IICT. It is a University under the State Act of Gujarat. The DA-IICT was established in Gandhinagar in 2001. It is the only advanced institute named after the Late Dhirubhai Ambani, the founder of Reliance Group.</p>\r\n<p>The architecture of DA-IICT is functional, but what surrounds it is a fascinating garden. The entire design was oriented to "Preserving the Environment". The different blocks are located such that there is minimum damage to trees. Most of the 2566 trees chosen are indigenous varieties. The lawn area measures roughly 50,000 square meters with 3900 square meters of wild St Augustine grass. 3400 Bamboos were planted to mask the concrete. Next to the library stands the herb garden with 35 varieties of rare medicinal plants. The entire landscape was planned and developed in a manner that no excess rainwater is lost and all irrigation is carried out with recycled water. Over 30 species of birds are observed in the campus.</p>\r\n<p>Â </p>', '', 1, 0, 0, 7, '2011-03-31 21:30:57', 42, '', '2011-04-01 00:31:20', 42, 0, '0000-00-00 00:00:00', '2011-03-31 21:30:57', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 3, 0, 0, '', '', 1, 448, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
