(69, 139, 'Gallery', 'gallery-wie', '', '<p>Â </p>\r\n<p>Â </p>\r\n<p><span style="font-family: ''Times New Roman'', serif; font-size: 16px;">The following photographs were captured during the course of the two events conducted during the year 2010, a brief description of each of the photograph clicked is mentioned below the respective photograph:</span></p>\r\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; mso-line-height-alt: 11.25pt;">Visit to Kadi School</p>\r\n<p class="MsoNormal"><span style="text-decoration: underline;"><strong><em><span style="font-size: 12.0pt; line-height: 115%; mso-bidi-font-family: Calibri; mso-no-proof: yes;" lang="EN-IN"> <img src="images/wie/image001.jpg" border="0" /><br /></span><span style="font-size: 12.0pt; line-height: 115%; mso-bidi-font-family: Calibri;" lang="EN-IN"> </span></em></strong></span></p>\r\n<p class="MsoNormal"><span style="font-size: small;"><span style="line-height: 18px;">Picture1: The above photographs shows students seated in the hall where the event was conducted</span></span></p>\r\n<p class="MsoNormal"><span style="text-decoration: underline;"><strong><em><span style="font-size: 12.0pt; line-height: 115%; mso-bidi-font-family: Calibri; mso-no-proof: yes;" lang="EN-IN"> <img src="images/wie/image003.jpg" border="0" /><br /></span><span style="font-size: 12.0pt; line-height: 115%; mso-bidi-font-family: Calibri;" lang="EN-IN"> </span></em></strong></span></p>\r\n<p class="MsoNormal"><span style="font-size: small;"><span style="line-height: 18px;">Picture2: The second photograph features the various WIE members who had volunteered for the event. From Left: Poojan Shah, Parth Mehta, Maullik Padia, Hetaswi Vankani, Shirali Desai.</span></span></p>\r\n<ol style="margin-top: 0in;" type="1"> </ol>\r\n<p><span style="text-decoration: underline;"><strong><em> </em></strong></span></p>\r\n<p class="MsoNormal"><strong><em><span style="font-size: 12.0pt; line-height: 115%; mso-bidi-font-family: Calibri;" lang="EN-IN"><img src="images/wie/image009.jpg" border="0" /></span></em></strong></p>\r\n<p class="MsoNormal"><span style="font-size: 12.0pt; line-height: 115%; mso-bidi-font-family: Calibri;" lang="EN-IN"><span style="font-size: small;">Picture3: Hetaswi Vankani delivering her speech.</span></span></p>\r\n<p><strong><em><span style="font-size: 12.0pt; line-height: 115%; mso-bidi-font-family: Calibri; mso-no-proof: yes;" lang="EN-IN"><img src="images/wie/image005.jpg" border="0" /></span></em></strong></p>\r\n<p class="MsoNormal"><strong><em><span style="font-size: 12.0pt; line-height: 115%; mso-bidi-font-family: Calibri;" lang="EN-IN"> </span></em></strong></p>\r\n<p><strong><em> </em></strong></p>\r\n<p>Â </p>\r\n<p class="MsoNormal"><span style="font-size: small;"><span style="line-height: 18px;">Picture4: Vedang Patel, as he talks to the Kadi School students about career opportunities in the field of Engineering</span></span></p>\r\n<p><span style="text-decoration: underline;"><strong><em> </em></strong></span></p>\r\n<p class="MsoNormal"><strong><em><span style="font-size: 12.0pt; line-height: 115%; mso-bidi-font-family: Calibri; mso-no-proof: yes;" lang="EN-IN"> <img src="images/wie/image007.jpg" border="0" /></span></em></strong></p>\r\n<p class="MsoNormal"><span style="font-size: 12.0pt; line-height: 115%; mso-bidi-font-family: Calibri; mso-no-proof: yes;" lang="EN-IN"><span style="font-size: small;">Picture5: Parth Mehta talked about the various medical colleges in Gujarat and India and the preparation required for medical entrance exams</span></span></p>\r\n<p class="MsoNormal"><span style="font-size: xx-small;"><span style="line-height: 18px;"><br /></span></span></p>\r\n<p><span style="text-decoration: underline;"> </span></p>\r\n<p class="MsoNormal"><strong><em><span style="font-size: 12.0pt; line-height: 115%; mso-bidi-font-family: Calibri; mso-no-proof: yes;" lang="EN-IN"> <img src="images/wie/image009.jpg" border="0" /></span></em></strong></p>\r\n<p class="MsoNormal"><span style="font-size: 12.0pt; line-height: 115%; mso-bidi-font-family: Calibri; mso-no-proof: yes;" lang="EN-IN"><span style="font-size: small;">Picture6: Hetaswi Vankani talked about career opportunities in Pure Science and Fine Arts</span></span><span style="font-size: 16px; line-height: 18px;">.</span></p>\r\n<p><span style="text-decoration: underline;"><strong><em> </em></strong></span></p>\r\n<p class="MsoNormal"><strong><em><span style="font-size: 12.0pt; line-height: 115%; mso-bidi-font-family: Calibri; mso-no-proof: yes;" lang="EN-IN"> <img src="images/wie/image011.jpg" border="0" /></span></em></strong></p>\r\n<p class="MsoNormal"><span style="font-size: 12.0pt; line-height: 115%; mso-bidi-font-family: Calibri; mso-no-proof: yes;" lang="EN-IN"><span style="font-size: small;">Picture7: Poojan Shah delivers his speech on career opportunities in the field of Commerce</span></span></p>\r\n<p><strong><em> </em></strong></p>\r\n<p><span style="font-size: small;"><span style="line-height: 18px;"><br /></span></span></p>\r\n<p><span style="text-decoration: underline;"><strong><em> </em></strong></span></p>\r\n<p class="MsoNormal"><strong><em><span style="font-size: 12.0pt; line-height: 115%; mso-bidi-font-family: Calibri; mso-no-proof: yes;" lang="EN-IN"> <img src="images/wie/image013.jpg" border="0" /></span></em></strong></p>\r\n<p><strong><em> </em></strong></p>\r\n<p>Picture8: Maullik Padia as he talks about the importance of higher education in the current competitive scenario.</p>\r\n<p><span style="text-decoration: underline;"><strong><em> </em></strong></span></p>\r\n<p class="MsoNormal"><strong><em><span style="font-size: 12.0pt; line-height: 115%; mso-bidi-font-family: Calibri; mso-no-proof: yes;" lang="EN-IN"> <img src="images/wie/image015.jpg" border="0" /></span></em></strong></p>\r\n<p><strong><em> </em></strong></p>\r\n<p>Picture9: Prize distribution that followed the quiz conducted by Parth Mehta.</p>\r\n<p><span style="text-decoration: underline;"><strong><em> </em></strong></span></p>\r\n<p class="MsoNormal"><strong><em><span style="font-size: 12.0pt; line-height: 115%; mso-bidi-font-family: Calibri; mso-no-proof: yes;" lang="EN-IN"> <img src="images/wie/image017.jpg" border="0" /></span></em></strong></p>\r\n<p><strong><em> </em></strong></p>\r\n<p>Picture10: WIE team at Kadi School.<br /><br />SEWA Invited talk</p>\r\n<p class="MsoNormal" style="margin-left: .25in;"><em><span style="font-size: 12.0pt; line-height: 115%; mso-bidi-font-family: Calibri; mso-no-proof: yes;" lang="EN-IN"> <img src="images/wie/image019.jpg" border="0" /></span></em></p>\r\n<p>Picture11: Photograph of Mrs. Bharati Bhavsar as she talks about the goals of SEWA and the various steps taken by them to achieve the same.</p>\r\n<p><em> </em><em> </em></p>\r\n<p><span style="text-decoration: underline;"><strong><em> </em></strong></span></p>\r\n<p class="MsoNormal" style="margin-left: .25in;"><strong><em><span style="font-size: 12.0pt; line-height: 115%; mso-bidi-font-family: Calibri; mso-no-proof: yes;" lang="EN-IN"> <img src="images/wie/image021.jpg" border="0" /></span></em></strong></p>\r\n<p>Picture12: A video shown during the presentation that features Hillary Clinton, the United States Secretary of State as she visits SEWA to show her support for the various activities they conduct to boost women empowerment.</p>\r\n<p><span style="text-decoration: underline;"><strong><em> </em></strong></span></p>\r\n<p class="MsoNormal" style="margin-left: .25in;"><strong><em><span style="font-size: 12.0pt; line-height: 115%; mso-bidi-font-family: Calibri;" lang="EN-IN"> <img src="images/wie/image023.jpg" border="0" /></span></em></strong></p>\r\n<p>Picture13: Form left, WIE Chair, Hetaswi Vankani, Roshni, Mrs. Bharati Bhavsar as a memento is presented to Roshni.</p>\r\n<p><strong><em> </em></strong></p>\r\n<p>Â </p>\r\n<p><span style="text-decoration: underline;"><strong><em> </em></strong></span></p>\r\n<p class="MsoNormal" style="margin-left: .25in;"><strong><em><span style="font-size: 12.0pt; line-height: 115%; mso-bidi-font-family: Calibri; mso-no-proof: yes;" lang="EN-IN"> <img src="images/wie/image025.jpg" border="0" /></span></em></strong></p>\r\n<p class="MsoNormal" style="margin-left: .25in;"><span style="font-size: 12.0pt; line-height: 115%; mso-bidi-font-family: Calibri; mso-no-proof: yes;" lang="EN-IN"><span style="font-size: small;">Picture14: Stall by SEWA outside the lecture theatre for sale of garments and handicraft products made by rural women.</span></span></p>', '', 1, 0, 0, 24, '2011-04-14 13:08:52', 42, '', '2011-09-19 17:11:32', 42, 0, '0000-00-00 00:00:00', '2011-04-14 13:08:52', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 23, 0, 0, '', '', 1, 449, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', '');
