(70, 140, 'SPAC - Student Professional Awareness Program (7th Aug. 2011)', 'spac-student-professional-awareness-program-7th-aug-2011', '', '<p>Â </p>\r\n<h3><strong>Student Professional Awareness Conference (S-PAC)</strong></h3>\r\n<p>Â </p>\r\n<p><span style="text-decoration: underline;"><strong><a href="../spac/">Click to open website.</a></strong></span></p>\r\n<p><br />Engineers must be proficient, professionally astute, and clearly aware of their responsibility to society. So, IEEE Student Branch, DA-IICT proposes to conduct S-PAC which allows students to gain valuable management experience, self-confidence, and positive attitude. Student Professional Awareness Conferences (S-PACs, pronounced "ess-paks") explore the subjects that affect engineers'' careers, regardless of how well engineers prepare themselves technically.</p>\r\n<p>First introduced in 1979, S-PACs are an effective vehicle to transmit the professional awareness that enhances the technical education they receive in engineering school.Â  S-PACs permit students to learn from the varied experience of successful engineers.</p>\r\n<p><br />S-PACs are structured events where students listen to experienced professionals from diverse backgrounds discuss topics from the six critical categories as described below.Â  Students have a chance to interact with the speakers, usually through a roundtable discussion.</p>\r\n<p><br /><em>The proposed topics for the conference will be:</em></p>\r\n<p>Â </p>\r\n<p>â€¢Â Â Â  <strong>The realities of getting Job and working environment : The realities of getting Job and being successful in the working environment including job hunting, resume writing and job interview skills, creating oneâ€™s own company, consulting careers, role models and mentors and office climate and working conditions.</strong><br /><br />â€¢Â Â Â  <strong>Our Role in shaping and building public policy: Shaping and directing public policy by interacting with government and regulatory agencies, drafting and introducing legislation, lobbying, being technologically competitive, and creating technical policies.</strong><br /><br />â€¢Â Â Â  <strong>Planning 4yrs of your Graduation: Planning 4yrs of graduation, when to start, how to start, what approach should be used, fixing goals for the end , approaching towards the fixed goal, dealing with various problems during these 4 years. </strong><br /><br />â€¢Â Â Â  <strong>What does â€œEngineeringâ€ mean to a Student: What exactly is engineering, its role and importance in society, general image of engineering among students, problems if any associated with this image, what should be the right approach of a student towards engineering practice.</strong><br /><br />â€¢Â Â Â  <strong>The functions of societies like IEEE in shaping students career and profession: How professional societies like IEEE conduct volunteer activities, provide opportunities for professional development and personal growth.</strong><br /><br /></p>\r\n<p><a href="https://docs.google.com/viewer?a=v&amp;pid=explorer&amp;chrome=true&amp;srcid=0B1WOXTVCIdxrNWI0YzRlZTMtNDMwNi00NzE2LTliMDgtNmI4NzhhMmU2M2Jh&amp;hl=en&amp;authkey=CK-4gJMI&amp;pli=1">Click here to view brochure.</a></p>', '', 0, 0, 0, 9, '2011-05-01 10:51:57', 42, '', '2011-07-22 08:47:20', 42, 0, '0000-00-00 00:00:00', '2011-05-01 10:51:57', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 11, 0, 2, '', '', 1, 218, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
