(73, 144, 'One Day Workshop on GIS Technology organized by DAIICT, IEEE and ESRI-India', 'one-day-workshop-on-gis-technology-organized-by-daiict-ieee-and-esri-india', '', '<p><span style="color: #534616; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25px;">With the development of geospatial technology, GIS tool has become an integral part of this technology. As the data of the earth natural resources are available from various sources and format, it is important to port all of these data in the common platform for the purpose of decision making process. GIS provides the common platform to integrate the different sources of data. It is a convenient tool to create, edit, modify and analyze not only vector data but also raster data sources from satellite platform.<br />The workshop is aimed to expose the DAIICT students to the GIS technology and to sensitize them to the various opportunities in this upcoming field of geospatial technology development.</span></p>\r\n<p><span style="color: #534616; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"> </span></p>\r\n<p style="margin-top: 0px; line-height: 25px;"><strong>Date:</strong></p>\r\n<p style="margin-top: 0px; line-height: 25px;"><strong style="font-size: 16px; color: #cc0000;"><em>30 July, 2011</em></strong></p>\r\n<p>Â </p>\r\n<p><span style="color: #534616; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: 25px;"><a href="../gis/">http://ieee.daiict.ac.in/gis/</a></span></p>', '', 0, 0, 0, 9, '2011-07-27 15:45:51', 42, '', '2011-07-27 15:47:19', 42, 0, '0000-00-00 00:00:00', '2011-07-27 15:45:51', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 2, 0, 1, '', '', 1, 79, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(74, 145, 'GIS Workshop', 'gis-workshop', '', '<p><span style="color: #534616; font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: normal;"> </span></p>\r\n<h2 class="title" style="padding-top: 12px; padding-right: 0px; padding-bottom: 0px; padding-left: 20px; font-family: Georgia, ''Times New Roman'', Times, serif; font-weight: normal; color: #ffffff; font-size: 1.8em; height: 38px; background-image: url(../gis/images/img01.jpg); background-attachment: initial; background-origin: initial; background-clip: initial; background-color: #1e1e1e; letter-spacing: -0.5px; background-position: 0% 0%; background-repeat: no-repeat no-repeat; margin: 0px;"><a href="../gis/index.html" style="text-decoration: none; color: #ffffff; border: initial none initial;">One Day Workshop on GIS Technology organized by DAIICT, IEEE and ESRI-India</a></h2>\r\n<div class="entry" style="background-image: url(../gis/images/img02.jpg); background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; padding-top: 0px; padding-right: 20px; padding-left: 20px; padding-bottom: 20px; text-align: justify; background-position: 0% 0%; background-repeat: no-repeat no-repeat;"><br />\r\n<p style="margin-top: 0px; line-height: 25px;"><strong style="font-size: 18px;">Purpose of the workshop:</strong> With the development of geospatial technology, GIS tool has become an integral part of this technology. As the data of the earth natural resources are available from various sources and format, it is important to port all of these data in the common platform for the purpose of decision making process. GIS provides the common platform to integrate the different sources of data. It is a convenient tool to create, edit, modify and analyze not only vector data but also raster data sources from satellite platform.<br />The workshop is aimed to expose the DAIICT students to the GIS technology and to sensitize them to the various opportunities in this upcoming field of geospatial technology development.</p>\r\n<p style="margin-top: 0px; line-height: 25px;"><a href="../gis">http://ieee.daiict.ac.in/gis</a></p>\r\n</div>\r\n<p>Â </p>', '', 1, 0, 0, 42, '2011-07-27 15:48:39', 42, '', '2011-09-19 14:39:47', 42, 0, '0000-00-00 00:00:00', '2011-07-27 15:48:39', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 3, 0, 3, '', '', 1, 153, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
