(76, 147, 'DA-IICT wins 2010 IEEE WIE Student Branch Affinity Group of the Year Award at R10', 'da-iict-wins-2010-ieee-wie-student-branch-affinity-group-of-the-year-award-at-r10', '', '<p>DA-IICT wins 2010 IEEE WIE Student Branch Affinity Group of the Year Award at R10.</p>', '', -2, 0, 0, 15, '2011-09-06 14:25:44', 42, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2011-09-06 14:25:44', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 1, 0, 2, '', '', 1, 14, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(77, 148, 'i.Fest-2011', 'ifest2011', '', '<p><span style="color: #000000; font-family: Verdana, Geneva, sans-serif;"><span style="font-size: 17px; line-height: 30px;"><strong><span style="text-decoration: underline;"> </span></strong></span></span></p>\r\n<p><strong>i.fest was born out of the motive to celebrate 125 years of IEEE. The main aim of the fest is to act as a platform for spreading knowledge about science and technology with fun. It provides an opportunity to learn new things and applying the things learnt to solve some existing problems in the real world. The events that will be conducted over the two days will make you think beyond the limits, let your imagination go to newer places, bring out your creative skills and in the end leave you wanting for more. With a range of events from the field of electronics to computer science and to know what the eminent personalities have to say about the current things that are happening around, i.fest will give perfect platform to excel in the field of science and technology. Besides giving you the opportunity to compete with your peers, i.fest also provides a common platform to students from all over India to share their experiences and knowledge with their fellow IEEE members.</strong></p>\r\n<p><strong> </strong></p>\r\n<p><strong>Anticipation, exhilaration and exuberance are all a part of this fest. So, be a part of this extravaganza which offers a junction of fun, technology, and wisdom.</strong></p>\r\n<p><strong> </strong></p>\r\n<p><strong><a href="../ifest">http://ieee.daiict.ac.in/ifest</a></strong></p>\r\n<p><strong> </strong></p>\r\n<p>Â </p>\r\n<p>Â </p>\r\n<p>Â </p>', '', 1, 0, 0, 42, '2011-09-06 23:56:33', 42, '', '2011-11-05 06:11:16', 42, 0, '0000-00-00 00:00:00', '2011-09-06 23:56:33', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 6, 0, 2, '', '', 1, 277, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(78, 149, 'DA-IICT wins 2010 IEEE WIE Affinity Group of the Year Award', 'da-iict-wins-2010-ieee-wie-affinity-group-of-the-year-award', '', '<div><strong>Women In Engineering (WIE) wing of the IEEE Student Branch at DAIICT has won the reputed 2010 IEEE WIE Affinity Group of the Year Award.</strong></div>\r\n<div>The WIE group was founded in the year 2009 at DA-IICT and it has since then, actively been conducting activities to promote women participation. They had earlier bagged the Darrel Chong Award and various funds including the Sangammam Fund and the Congress Support Fund. In 2010, the affinity group took upon themselves to increase the outreach of their activities. The group through the support and encouragement of professors like Prof. Mehul Raval, Prof. Deepak Ghodgaonkar, Prof. Anil Roy, Prof. Suman Mitra, Dr. Rahul Dubey and Prof. Sanjay Chaudhary, conducted activities on both the humanitarian and technical front.</div>\r\n<div>Among the various activities conducted by the WIE group included career counselling sessions for less privileged students and organizing talks by NGOs. Additionally, the group at DA-IICT has organized many technical workshops to offer a platform where people from academia and industry interacted with engineers and scientists of tomorrow and shared knowledge with them.</div>\r\n<div>The number of WIE members at DA-IICT has doubled in the past one year. The 2010 WIE executive committee at DAIICT â€“ Chair Hetaswi Vankani, Vice-Chair Shirali Desai have been very enthusiastic in encouraging participation of girls in various activities. The entire IEEE Student Branch strove to break the gender barrier that prevents women from either pursuing career in streams such as engineering or performing to the best of their ability.</div>\r\n<div>The award is an appreciation of the hard work put in by the IEEE Student Branch at DA-IICT and a motivation to raise the bar of how much more one can do for the society.</div>', '', 1, 0, 0, 15, '2011-09-14 18:20:57', 42, '', '2011-09-19 17:12:48', 42, 0, '0000-00-00 00:00:00', '2011-09-14 18:20:57', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 4, 0, 3, '', '', 1, 157, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(79, 150, 'WIE Congress 2011', 'wie-congress-2011', '', '<p>Â </p>\r\n<p>Women In Engineering Affinity Group of IEEE Student Branch, DA-IICT presents Annual WIE Congress-2011,an annual event filled with leisure and learning.</p>\r\n<p>Â </p>\r\n<p>The Congress is a one day event to be held at DA-IICT. It presents an opportunity for the different IEEE Student Branches of Gujarat to come together, interact and learn from each other.</p>\r\n<p>Â </p>\r\n<p>The Annual WIE Congress-2011 will include two guest lectures, some fun filled games, lots of exciting prizes, felicitation of winners of The Essay Competition and The Article Competition and the launch of the IEEE DA-IICT Magazine, a quarterly magazine started by the WIE Affinity Group IEEE SB DA-IICT.</p>\r\n<p>The Registration fees for the Congress is Rs.100 for Non IEEE members and Rs.80 for IEEE members.<br /><a href="../wiecongress/registration.php">http://ieee.daiict.ac.in/wiecongress/registration.php</a></p>\r\n<p>Â </p>\r\n<p>Date: 16th Oct, 2011</p>\r\n<p><a href="../wiecongress/">http://ieee.daiict.ac.in/wiecongress/</a></p>\r\n<p>Â </p>', '', 1, 0, 0, 42, '2011-09-19 14:42:38', 42, '', '2011-11-05 06:11:32', 42, 0, '0000-00-00 00:00:00', '2011-09-19 14:42:38', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 5, 0, 0, '', '', 1, 198, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(80, 151, 'NS2 - Network Simulator Workshop', 'ns2-network-simulator-workshop', '', '<div class="content"><a href="../wns2/cfp.pdf" target="_blank"><em>Download CFP</em></a><span style="text-decoration: underline;"><strong><br /></strong></span>\r\n<p>With the new semester coming up, here comes IEEE once again to  enhance your creative skills and learn more about the technological  advancements around the globe.</p>\r\n<p>With this aim IEEE Gujarat Section along with IEEE Student  Branch,DA-IICT bring to a workshop on NS2 - Network Simulator on 6-8th  January 2012 at DA-IICT. The aim of this workshop is to provide  understanding the architecture and working of ns2 and provides hands of  training in ns2 to networking researchers from both academia and  industry. The workshop also aims to brief the evolution of ns-2, now  that ns-3 and it''s extension in novel research areas and networking  technologies and scenarios.</p>\r\n<p>It is highly recommended for postgraduates to attend the workshop as  this a a very important tool and also for undergraduates who wish to  pursue studies in networking field.</p>\r\n<h2>Topics:</h2>\r\n<p>1. Overview of NS2 and TCL</p>\r\n<p>2. Wired Network Simulation</p>\r\n<p>3. Wireless Network Simulation</p>\r\n<p>4. Implementing Routing Protocols</p>\r\n<p>5. Congestion Control Strategies</p>\r\n<p>6. Simulating TCP Protoco</p>\r\n</div>', '', 1, 0, 0, 9, '2012-01-02 13:07:23', 42, '', '2012-01-02 13:12:17', 42, 0, '0000-00-00 00:00:00', '2012-01-02 13:07:23', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 3, 0, 0, '', '', 1, 141, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(81, 152, 'NS2 - Network Simulator Workshop', 'ns2-network-simulator-workshop', '', '<p>For more information, visit</p>\r\n<p><a href="../wns2/index.html" target="_blank">NS2 workshop website</a></p>', '', 1, 0, 0, 15, '2012-01-02 13:14:07', 42, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2012-01-02 13:14:07', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 1, 0, 2, '', '', 1, 104, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(82, 153, 'Arduino Workshop @ DA-IICT', 'arduino-workshop-da-iict', '', '<div style="font-size: 12pt; color: #000000; font-family: Times New Roman;"><span>We  all love micro controllers, in some way or the other. The great things  they can do always encourages us to learn how to work with them and  believe me, with Arduino, now anyone, even a school kid can program and  do fantastic stuff with it.</span></div>\r\n<div style="font-size: 12pt; color: #000000; font-family: Times New Roman;"><span><br /></span></div>\r\n<div style="font-size: 12pt; color: #000000; font-family: Times New Roman;"><span> </span></div>\r\n<div style="font-size: 12pt; color: #000000; font-family: Times New Roman;"><span>So  the IEEE Student Branch DA-IICT is organizing an Arduino workshop,  which will help all of you to get introduced to the fascinating world of  Arduino and see its immense power especially when the ease of coding is  concerned, and you will also get a chance to interface it with some  common sensors and actuators, hands-on, so that you can go home and  start working on the </span><span style="font-size: 12pt;">next-big-thing straight away!!!</span><span><br /></span></div>\r\n<div style="font-size: 12pt; color: #000000; font-family: Times New Roman;"><span style="font-size: 12pt;"><br /></span></div>\r\n<div style="font-size: 12pt; color: #000000; font-family: Times New Roman;"><span><strong>Some of the contents include:</strong></span></div>\r\n<div style="font-size: 12pt; color: #000000; font-family: Times New Roman;"><span>1) What is a micro-controller ? What is Arduino ?</span></div>\r\n<div style="font-size: 12pt; color: #000000; font-family: Times New Roman;"><span>2) Basic Arduino programming concepts.</span></div>\r\n<div style="font-size: 12pt; color: #000000; font-family: Times New Roman;"><span>3) Hands-on interfacing with Arduino boards : LEDs, Light Sensors, Motors etc.</span></div>\r\n<div style="font-size: 12pt; color: #000000; font-family: Times New Roman;"><span>4) Interesting projects using combination of techniques learned.</span></div>\r\n<div style="font-size: 12pt; color: #000000; font-family: Times New Roman;"><span>And much more...</span></div>\r\n<div style="font-size: 12pt; color: #000000; font-family: Times New Roman;"><span><br /></span></div>\r\n<div style="font-size: 12pt; color: #000000; font-family: Times New Roman;"><strong>Date:</strong><span class="Apple-tab-span" style="white-space: pre;"> </span><strong><span id="OBJ_PREFIX_DWT43" class="Object">5th April 2012</span> </strong>@ <span>Lecture Theatre &amp; Labs,</span>DA-IICT<br />Time: 9 am - 5 pm</div>\r\n<div style="font-size: 12pt; color: #000000; font-family: Times New Roman;"><span><br /></span></div>\r\n<div style="font-size: 12pt; color: #000000; font-family: Times New Roman;">We have<strong> limited seats (50), </strong>and they will be filled on a<strong> first-come-first-serve basis. </strong></div>\r\n<div style="font-size: 12pt; color: #000000; font-family: Times New Roman;"><strong><br /></strong></div>\r\n<div style="font-size: 12pt; color: #000000; font-family: Times New Roman;"><strong>Registration fees details: ( inclusive of breakfast &amp; lunch, exclusive of hardware kit )</strong></div>\r\n<div style="font-size: 12pt; color: #000000; font-family: Times New Roman;"><span style="font-size: 12pt;">1)</span><span style="font-size: 12pt;">IAS/PELS Members :<span class="Apple-tab-span" style="white-space: pre;"> </span>FREE</span></div>\r\n<div style="font-size: 12pt; color: #000000; font-family: Times New Roman;"><span>2)IEEE Members<span class="Apple-tab-span" style="white-space: pre;"> </span> <span class="Apple-tab-span" style="white-space: pre;"> </span> :<span class="Apple-tab-span" style="white-space: pre;"> </span>Rs. 200/-</span></div>\r\n<div style="font-size: 12pt; color: #000000; font-family: Times New Roman;"><span>3)Others<span class="Apple-tab-span" style="white-space: pre;"> </span> :<span class="Apple-tab-span" style="white-space: pre;"> </span>Rs.300/-</span></div>\r\n<div style="font-size: 12pt; color: #000000; font-family: Times New Roman;"><span> </span></div>\r\n<div style="font-size: 12pt; color: #000000; font-family: Times New Roman;"><span style="font-size: 12pt;">For registration, </span>DAIICT students contact: (<strong>Deadline: <span id="OBJ_PREFIX_DWT44" class="Object">3rd April</span>, 2012 Midnight</strong>)</div>\r\n<div style="font-size: 12pt; color: #000000; font-family: Times New Roman;"><span>Sharan:Â Â Â  <span class="Apple-tab-span" style="white-space: pre;"> </span>+91-9737073420<span class="Apple-tab-span" style="white-space: pre;"> </span>H110</span></div>\r\n<div style="font-size: 12pt; color: #000000; font-family: Times New Roman;"><span>Vani:<span class="Apple-tab-span" style="white-space: pre;"> </span>+91-9173184984<span class="Apple-tab-span" style="white-space: pre;"> </span>J217</span></div>\r\n<div style="font-size: 12pt; color: #000000; font-family: Times New Roman;"><span><br /></span></div>\r\n<div style="font-size: 12pt; color: #000000; font-family: Times New Roman;"><span>Non DA-IICT students, please <span id="OBJ_PREFIX_DWT45" class="Object"><a href="https://docs.google.com/spreadsheet/embeddedform?formkey=dC1tNVVrdUJEV1NvVmhxU2ZMZnZUNWc6MQ" target="_blank">register yourself here</a></span> and make the payment on the spot.</span></div>\r\n<div style="font-size: 12pt; color: #000000; font-family: Times New Roman;"><span> </span></div>\r\n<div style="font-size: 12pt; color: #000000; font-family: Times New Roman;"><span>\r\n<div><span>Explore more about Arduino at :</span> <span id="OBJ_PREFIX_DWT46" class="Object"><a href="http://www.arduino.cc/" target="_blank">http://www.arduino.cc/</a></span> and yes, its Open Source !!!</div>\r\n</span></div>', '', 1, 0, 0, 15, '2012-04-02 23:55:16', 42, '', '2012-04-02 23:57:12', 42, 42, '2012-04-05 09:59:12', '2012-04-02 23:55:16', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 2, 0, 1, '', '', 1, 28, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
