(1, 46, 'About IEEE Gujrat Section', 'about-ieee-gujrat-section', '', '<p class="MsoNormal" style="line-height: 15.6pt; background: none repeat scroll 0% 0%;"><span style="color: #333333;">The IEEE Gujarat Section endeavors to promote awareness among students on the opportunities that exist in the field of electronics and electrical engineering. Our objective is to bridge the gap between industry and students studying in technology-related fields, while promoting and providing an intellectually stimulating university environment for the student body.</span></p>\r\n<p class="MsoNormal" style="line-height: 15.6pt; background: none repeat scroll 0% 0%;"><span style="color: #333333;">On 15th August 1990, IEEE Hq. approved IEEE Gujarat Sub- Section in a full-fledged IEEE Gujarat Section. IEEE Gujarat Section is one of the 10 Sections in India coming under Asia-Pacific Region, the Region 10 of IEEE.</span></p>\r\n<p class="MsoNormal" style="line-height: 15.6pt; background: none repeat scroll 0% 0%;"><span style="color: #333333;">Though preparations started much earlier by Professor Akshai K. Aggarwal. Associated with him were many other active members from both the industry and academia. ONGC, SAC (ISRO), Inductotherm, Amtech Electronics, Hirel Electronics, faculty members of DDIT, MS Univ, many entrepreneur engineers were among the key contributors while conceiving this section. Roughly speaking membership strength of active members is around 500, among which 300 are student members belonging to various student branches. We have 1 Fellow, 25 Senior Members, 170 Members and 15 Associate Members. In 1990 there were around 100 members. These figures may not be precise, only indicative.</span></p>\r\n<p class="MsoNormal" style="line-height: 15.6pt; background: none repeat scroll 0% 0%;"><span style="color: #333333;">The Section has had the good fortune of association of eminent professionals as Members or Convenors/Chairmen of various technical/program committees.</span></p>\r\n<p class="MsoNormal" style="line-height: 15.6pt; background: none repeat scroll 0% 0%;"><span style="color: #333333;">In past years, IEEE Gujarat Section was very active in organizing various state and national level technical events for the benefit of student of Gujarat, in particular. These include</span></p>\r\n<p class="MsoNormal" style="margin-left: 42pt; text-indent: -18pt; line-height: 15.6pt; background: none repeat scroll 0% 0%;"><span style="color: #333333;"><span>1.</span></span><span style="color: #333333;">National Workshop on Challenges in VLSI</span></p>\r\n<p class="MsoNormal" style="margin-left: 42pt; text-indent: -18pt; line-height: 15.6pt; background: none repeat scroll 0% 0%;"><span style="color: #333333;"><span>2.</span></span><span style="color: #333333;">Two-day Intensive Workshop on Embedded Systems</span></p>\r\n<p class="MsoNormal" style="margin-left: 42pt; text-indent: -18pt; line-height: 15.6pt; background: none repeat scroll 0% 0%;"><span style="color: #333333;"><span>3.</span></span><span style="color: #333333;">Half Day Seminar on Artificial Intelligence</span></p>\r\n<p class="MsoNormal" style="margin-left: 42pt; text-indent: -18pt; line-height: 15.6pt; background: none repeat scroll 0% 0%;"><span style="color: #333333;"><span>4.</span></span><span style="color: #333333;">National Symposium on Packet Data Services in CDMA</span></p>\r\n<p class="MsoNormal" style="line-height: 15.6pt; background: none repeat scroll 0% 0%;"><span style="color: #333333;">In year 2006 also we started with great zeal and enthusiasm with successful organization of the following programmes</span></p>\r\n<p class="MsoNormal" style="margin-left: 42pt; text-indent: -18pt; line-height: 15.6pt; background: none repeat scroll 0% 0%;"><span style="color: #333333;"><span>1.</span></span><span style="color: #333333;">Workshop on MPEG</span></p>\r\n<p class="MsoNormal" style="margin-left: 42pt; text-indent: -18pt; line-height: 15.6pt; background: none repeat scroll 0% 0%;"><span style="color: #333333;"><span>2.</span></span><span style="color: #333333;">Two Day Intensive Workshop on VLSI Chip Design</span></p>\r\n<p class="MsoNormal" style="margin-left: 42pt; text-indent: -18pt; line-height: 15.6pt; background: none repeat scroll 0% 0%;"><span style="color: #333333;"><span>3.</span></span><span style="color: #333333;">National Seminar on Computer Vision and Image Processing</span></p>\r\n<p class="MsoNormal" style="margin-left: 42pt; text-indent: -18pt; line-height: 15.6pt; background: none repeat scroll 0% 0%;"><span style="color: #333333;"><span>4.</span></span><span style="color: #333333;">Intensive Workshop on Service-Oriented Computing</span></p>\r\n<p class="MsoNormal" style="line-height: 15.6pt; background: none repeat scroll 0% 0%;"><span style="color: #333333;">We received IEEE R10 Distinguished Small Section Award for year 2005 based on the activities we conducted in 2004. This includes 12th International Conference on GRID COMPUTING which was held at Nirma University during December 2004.</span></p>\r\n<p class="MsoNormal" style="line-height: 15.6pt; background: none repeat scroll 0% 0%;">Â </p>\r\n<p class="MsoNormal" style="line-height: 15.6pt; background: none repeat scroll 0% 0%;"><strong><span>IEEE Student Branches Under Gujrat Section</span></strong></p>\r\n<p class="MsoNormal" style="line-height: 15.6pt; background: none repeat scroll 0% 0%;"><strong></strong>An "IEEE Student Branch" is an IEEE entity that helps students in a specific educational institution. There are around 375 approved student branches in R10, few of them are not so active (50 have become dormant over a period of time). Of these, over 150 student branches are located in many major Universities and Engineering Colleges all over India. Each Student Branch is attached to the nearest IEEE Section.</p>\r\n<p class="MsoNormal" style="line-height: 15.6pt; background: none repeat scroll 0% 0%;">Â </p>\r\n<p class="MsoNormal" style="margin-left: 42pt; text-indent: -18pt; line-height: 15.6pt; background: none repeat scroll 0% 0%;"><span style="color: #333333;"><span>1.</span></span><span style="color: #333333;">M S (Maharaja Sayajirao) University, Vadodara (1st Student Branch under Gujarat Section)</span></p>\r\n<p class="MsoNormal" style="margin-left: 42pt; text-indent: -18pt; line-height: 15.6pt; background: none repeat scroll 0% 0%;"><span style="color: #333333;"><span>2.</span></span><span style="color: #333333;">Gujarat University, Ahmedabad</span></p>\r\n<p class="MsoNormal" style="margin-left: 42pt; text-indent: -18pt; line-height: 15.6pt; background: none repeat scroll 0% 0%;"><span style="color: #333333;"><span>3.</span></span><span style="color: #333333;">Nirma Institute of Technology, Ahmedabad (22 September 1999)</span></p>\r\n<p class="MsoNormal" style="margin-left: 42pt; text-indent: -18pt; line-height: 15.6pt; background: none repeat scroll 0% 0%;"><span style="color: #333333;"><span>4.</span></span><span style="color: #333333;">DA-IICT, Gandhinagar (November 2004)</span></p>\r\n<p class="MsoNormal" style="margin-left: 42pt; text-indent: -18pt; line-height: 15.6pt; background: none repeat scroll 0% 0%;"><span style="color: #333333;"><span>5.</span></span><span style="color: #333333;">UV Patel College of Engineering, Mehsana (27 December 2004)</span></p>\r\n<p class="MsoNormal" style="margin-left: 42pt; text-indent: -18pt; line-height: 15.6pt; background: none repeat scroll 0% 0%;"><span style="color: #333333;"><span>6.</span></span><span style="color: #333333;">ADIT (A D Patel Institute of Technology), New V V Nagar (16 Feb 2006)</span></p>\r\n<p class="MsoNormal" style="margin-left: 42pt; text-indent: -18pt; line-height: 15.6pt; background: none repeat scroll 0% 0%;"><span style="color: #333333;"><span>7.</span></span><span style="color: #333333;">G H Patel College of Engineering &amp; Technology (GCET), V V Nagar (28 Feb 2006)</span></p>\r\n<p class="MsoNormal" style="margin-left: 42pt; text-indent: -18pt; line-height: 15.6pt; background: none repeat scroll 0% 0%;"><span style="color: #333333;"><span>8.</span></span><span style="color: #333333;">Institute of Science &amp; Technology for Advance Studies and Research (ISTAR), Vallabh Vidyanagar, Gujarat</span></p>\r\n<p class="MsoNormal" style="line-height: 15.6pt; background: none repeat scroll 0% 0%;"><span style="color: #333333;"><a href="http://ewh.ieee.org/r10/gujarat"><span style="color: #1b57b1;">More about IEEE Gujrat Section</span></a></span></p>', '', 1, 0, 0, 7, '2011-03-18 22:58:04', 42, '', '2012-04-10 12:23:49', 42, 0, '0000-00-00 00:00:00', '2011-03-18 22:58:04', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 10, 0, 2, '', '', 1, 693, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(2, 47, 'About IEEE', 'about-ieee', '', '<p class="MsoNormal" style="margin-bottom: 3.75pt; line-height: 15.6pt; mso-outline-level: 2;">Â </p>\r\n<p class="MsoNormal" style="margin-bottom: 3.75pt; line-height: 15.6pt; mso-outline-level: 2;"><span style="font-family: Calibri, sans-serif; font-size: 15px;">The IEEE formed in 1963 with the merger of the AIEE (American Institute of Electrical Engineers, formed in 1884), and the IRE (Institute of Radio Engineers, formed in 1912). From its earliest origins, the IEEE has:</span></p>\r\n<p class="MsoNormal" style="margin-bottom: 3.75pt; line-height: 15.6pt; mso-outline-level: 2;"><span style="mso-fareast-font-family: ''Times New Roman''; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin; color: #333333; mso-font-kerning: 18.0pt; mso-fareast-language: EN-IN; mso-bidi-font-weight: bold;"><span style="font-size: 11.0pt; line-height: 115%; font-family: ''Calibri'',''sans-serif''; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: ''Times New Roman''; mso-hansi-theme-font: minor-latin; mso-bidi-theme-font: minor-latin; color: #333333; mso-font-kerning: 18.0pt; mso-ansi-language: EN-IN; mso-fareast-language: EN-IN; mso-bidi-language: AR-SA; mso-bidi-font-weight: bold;">Â·</span><span style="font-size: 11.0pt; line-height: 115%; font-family: ''Calibri'',''sans-serif''; mso-ascii-theme-font: minor-latin; mso-fareast-font-family: ''Times New Roman''; mso-hansi-theme-font: minor-latin; mso-bidi-theme-font: minor-latin; color: #333333; mso-font-kerning: 18.0pt; mso-ansi-language: EN-IN; mso-fareast-language: EN-IN; mso-bidi-language: AR-SA;"> <span style="mso-bidi-font-weight: bold;">Advanced the theory and application of electro technology and allied sciences.</span></span></span></p>\r\n<p class="MsoNormal" style="margin-bottom: 3.75pt; line-height: 15.6pt; mso-outline-level: 2;"><span style="mso-fareast-font-family: ''Times New Roman''; mso-bidi-font-family: Calibri; mso-bidi-theme-font: minor-latin; color: #