(7, 52, 'Annual Report - 2009', 'annual-report-2009', '', '<p>Â </p>\r\n<p style="text-align: center;"><strong>Annual Report 2009</strong></p>\r\n<p style="text-align: center;"><strong>IEEE Student Branch, DA-IICT</strong></p>\r\n<p>Â </p>\r\n<p>IEEE Student Branch, DA-IICT got the following awards and the funding in the year 2009:-</p>\r\n<p>Â· The Darrel Chong Student Activity Award for"Intensive Workshop on High Speed Semiconductors"(Bronze).</p>\r\n<p>Â· The Darrel Chong Student Activity Award forâ€œTwo Days Workshop on Introduction to Application Development using J2EEâ€(Bronze).</p>\r\n<p>Â· The IEEE Student Enterprise Award 2009, 100% funding (US $1257) on project proposal authored by two of DAIICT students Dorav Kumar and Setu Gupta.</p>\r\n<p>Â· Proposal ofIEEE Student Branch, DA-IICTto R10 for ''Workshop on Project Management'' was approved and got the funding of US $400.</p>\r\n<p>Â· Sponsorship of US $500 for organizing S-PAC from the MGAB/SAC/SPAA IEEE funds.</p>\r\n<p>Â· IEEE Student Branch, DA-IICTgot the funding of US $250 for organizing i.fest â€“ marking the 125thanniversary of IEEE.</p>\r\n<p>Â </p>\r\n<p>We also participated in the following contests of R10/HQ level:-</p>\r\n<p>Â </p>\r\n<p>R10 Outstanding Student Branch Award</p>\r\n<p>The R10 website contest</p>\r\n<p>Membership Status: -IEEE Student Branch DA-IICT has 97 IEEE Student Members as on 31stDec. 2009.</p>\r\n<p>Â </p>\r\n<p>Student Branch Website(http://ieee.daiict.ac.in):-</p>\r\n<p>We have uploaded the new version of the student branch website, in which we have updated the content and have added various additional links like online access to IEEE Spectrum and The institute magazine. In addition to this, we used online registration system in all the events organized during the year 2009.</p>\r\n<p>Â </p>\r\n<p>Â </p>\r\n<p>Â </p>\r\n<p>Â </p>\r\n<p>Program Details:</p>\r\n<p>We organized 8 events and 3 talk sessions during the year 2009. The details are as follows:-</p>\r\n<p>Â </p