(40, 90, 'Summer School 2011', 'summer-school', '', '<p>Â </p>\r\n<p>For the first time DA-IICT brings ''Summer School-2011'' â€“ a  technological initiative to break the stereotype of a nonproductive  summer for budding engineers from all across the country.</p>\r\n<p>Summer school is here as a hub for all engineers of tomorrow  to come together today â€“ learn , innovate , implement and solve some  existing common social problems. It is only when these future engineers  interact that new ideas come into being and Summer School is a place for  such interaction. The program seeks to instill the value of working  with new technologies , IEEE standards and software in undergraduate  students so that they remain actively engaged in these activities that  contribute to their fields of interest.<br /> IEEE Student branch , DA-IICT aims to call hardware geeks ,  coders and designers who are undergraduate students of 1st, 2nd and 3rd  year together at one place and time for 12 days of strenuous work  tentatively from 13th June 2011 to 25th June 2011  to help them bring  out their creativity and talent and then implement their ideas for  betterment of technology and society.</p>\r\n<p><a href="../summerschool/" target="_blank">visit website</a></p>', '', 1, 0, 0, 42, '2011-03-27 07:37:23', 42, '', '2011-07-27 15:41:31', 42, 0, '0000-00-00 00:00:00', '2011-03-27 07:37:23', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 10, 0, 3, '', '', 1, 356, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', '');
