(43, 96, 'Minutes of meeting: 27th March', 'minutes-of-meeting-27th-march', '', '<p><span style="font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 11px; line-height: normal;">\r\n<p style="font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 11px; text-align: left; line-height: 16px; padding: 0px; margin: 0px;">Minutes of meeting: 27th March</p>\r\n<p style="font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 11px; text-align: left; line-height: 16px; padding: 0px; margin: 0px;">AI Publicity Meeting</p>\r\n<p style="font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 11px; text-align: left; line-height: 16px; padding: 0px; margin: 0px;">Â </p>\r\n<p style="font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 11px; text-align: left; line-height: 16px; padding: 0px; margin: 0px;">1 . Publicity for AI</p>\r\n<p style="font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 11px; text-align: left; line-height: 16px; padding: 0px; margin: 0px;">PDPU â€“ gaurav, aman</p>\r\n<p style="font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 11px; text-align: left; line-height: 16px; padding: 0px; margin: 0px;">LDRP and IIT â€“G â€“ atin, anshul, mayank</p>\r\n<p style="font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 11px; text-align: left; line-height: 16px; padding: 0px; margin: 0px;">Nirma â€“ Kedar, anit</p>\r\n<p style="font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 11px; text-align: left; line-height: 16px; padding: 0px; margin: 0px;">Vidhanagar â€“ Prateek, aman</p>\r\n<p style="font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 11px; text-align: left; line-height: 16px; padding: 0px; margin: 0px;">Also wing wise publicity to be done</p>\r\n<p style="font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 11px; text-align: left; line-height: 16px; padding: 0px; margin: 0px;">Â </p>\r\n<p style="font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 11px; text-align: left; line-height: 16px; padding: 0px; margin: 0px;">Sensors Workshop</p>\r\n<p style="font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 11px; text-align: left; line-height: 16px; padding: 0px; margin: 0px;">Rs. 50 for girls</p>\r\n<p style="font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 11px; text-align: left; line-height: 16px; padding: 0px; margin: 0px;">Rs 75 for boys</p>\r\n<p style="font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 11px; text-align: left; line-height: 16px; padding: 0px; margin: 0px;">Â </p>\r\n<p style="font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 11px; text-align: left; line-height: 16px; padding: 0px; margin: 0px;">Awards</p>\r\n<p style="font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 11px; text-align: left; line-height: 16px; padding: 0px; margin: 0px;">Student Branch and Larry K. Wilson award. Documents to be prepared by Rashmi, Megha and Vani</p>\r\n<p style="font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 11px; text-align: left; line-height: 16px; padding: 0px; margin: 0px;">Â </p>\r\n<p style="font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 11px; text-align: left; line-height: 16px; padding: 0px; margin: 0px;">Attendance:</p>\r\n<p style="font-family: ''lucida grande'', tahoma, verdana, arial, sans-serif; font-size: 11px; text-align: left; line-height: 16px; padding: 0px; margin: 0px;">Gaurav, darsh, poojan anshul, anit, atin, megha, hetaswi, parth, aman, prateek, rashmi, vani, vedang, aakriti</p>\r\n</span></p>', '', 1, 0, 0, 25, '2011-03-29 07:24:08', 42, '', '0000-00-00 00:00:00', 0, 0, '0000-00-00 00:00:00', '2011-03-29 07:24:07', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 1, 0, 5, '', '', 1, 151, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(44, 97, 'Student Branch Activities', 'sba1', '', '<p>Â </p>\r\n<h4>SIG(SPECIAL INTEREST GROUP)</h4>\r\n<p>What is SIG?</p>\r\n<p>A group of students who have a common interest, work towards a specific goal/project or just share their knowledge in the subject. You get to increase your knowledge base, get experience of working on projects, and interact with faculty and seniors. It is an ongoing process and there would be meetings throughout the semester.</p>\r\n<p>Three groups are planned</p>\r\n<p>â€“ SIG Embedded systems</p>\r\n<p>â€“ SIG Mathematics</p>\r\n<p>â€“ SIG Programming</p>\r\n<p>Â </p>\r\n<p>SIG EMBEDDED SYSTEMS:</p>\r\n<p>Learn about programming a micro-controller, different ICâ€™s sensors, interfaces used in today have embedded systems.</p>\r\n<p>Group Project: Get hands on experience in programming, hardware interface and pcb making.</p>\r\n<p>Meet the Geeks: People talk about what they worked on in the last month. Keeps everyone motivated.</p>\r\n<p>Â </p>\r\n<p>SIG PROGRAMMING</p>\r\n<p>Hack Days: A group hack session where you are supposed to build whatever you want. A prize at the end of the day to the best.</p>\r\n<p>Small individual Projects</p>\r\n<p>Meet the Geeks: People talk about what they worked on in the last month. Keeps everyone motivated.</p>\r\n<p>Â </p>\r\n<p>SIG MATHEMATICS:</p>\r\n<p>A lot of research work in computer science, signal processing, computer vision, algorithms is perused through mathematics. So it does make sense to promote student interest in applied mathematics.</p>\r\n<p>Â </p>\r\n<p>Â </p>\r\n<h4>K-SHARING:</h4>\r\n<p>K stands for â€œKnowledgeâ€. K-sharing is a synonym to video conferencing. Not every time can we expect highly honoured professors and industrialists give a speech on a technical topic, but K sharing is a feasible way to achieve this. We have professors from universities in and outside India giving lectures over Skype .Certain industrialists also share their practical experiences from wherever they are over video conferencing.</p>\r\n<p>Â </p>', '', 1, 0, 0, 11, '2011-03-29 08:28:17', 42, '', '2011-03-31 22:08:37', 42, 0, '0000-00-00 00:00:00', '2011-03-29 08:28:17', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 9, 0, 0, '', '', 1, 410, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
