(51, 107, 'Events(2009-2010)', 'events2009-2010', '', '<p>Â </p>\r\n<p><span style="text-decoration: underline;"><strong>Activity: Digital Image Processing Workshop</strong></span></p>\r\n<p>A one day workshop on Digital Image Processing was conducted on March 1, 2009 which received a participation of over 100 students. The motivation for the workshop was to deliver a small introduction to the field and the guidelines to pursue same.</p>\r\n<p>Â </p>\r\n<p>The following professors had delivered a talk during the workshop:</p>\r\n<p>1. Prof. Asim Banerjee: Introduction to Image Proceessing</p>\r\n<p>2. Prof. M. V. Joshi: Restoration and super Resolution</p>\r\n<p>3. Prof. Suman Mitra: Applications of Digital Image Processing</p>\r\n<p>Â </p>\r\n<p>The workshop succeeded in involving students in a cohesive drive in the academic world towards excellence in digital image processing. The event also won the Darrel Chong Student Activity Award.</p>', '', 1, 0, 0, 41, '2011-03-30 06:50:46', 42, '', '2011-04-01 00:04:17', 42, 0, '0000-00-00 00:00:00', '2011-03-30 06:50:46', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 7, 0, 2, '', '', 1, 291, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(52, 108, 'Executive Committee(2010-2011)', 'executive-committee2010-2011', '', '<p>Â </p>\r\n<p class="MsoNoSpacing">Chair Person: Hetaswi Vankani</p>\r\n<p class="MsoNoSpacing">Vice Chair Person: Shirali Desai</p>\r\n<p class="MsoNoSpacing">Program Coordinator: Aakriti Gupta</p>\r\n<p>Â </p>', '', 1, 0, 0, 32, '2011-03-30 06:51:48', 42, '', '2011-04-01 00:03:03', 42, 0, '0000-00-00 00:00:00', '2011-03-30 06:51:48', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 5, 0, 1, '', '', 1, 336, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(53, 109, 'Events(2010-2011)', 'events2010-2011', '', '<p>Â </p>\r\n<p><span style="text-decoration: underline;"><strong>Activity: Visit to Kadi School</strong></span></p>\r\n<p>Purpose:</p>\r\n<p>As a part of the humanitarian activities earlier proposed for the Sangamam Fund, a visit to a nearby school was planned in order to inform the higher secondary school students about career opportunities after 12th grade and to motivate them to work hard for the same.</p>\r\n<p>The Event:</p>\r\n<p>Targeting the school:</p>\r\n<p>The school which was targeted was the â€˜Kadi Schoolâ€™ located in Gandhinagar, Gujarat. This is a Gujarati medium state board school with a strength of about 3000, with about 240 students in the 11th and 12th standard. This particular school was targeted as it was found that the students were less aware about the importance of higher education. Also, there were considerable number of girls among the students, who we thought could be motivated.</p>\r\n<p>Planning the event and its execution:</p>\r\n<p>The contact details of â€˜Kadi Schoolâ€™ from a 3rd year BTech student at DA-IICT. We first had a word with Mr. Aravind Patel, a teacher at Kadi School. We visited the school once before the event and met the principal of the school, Mr. Chinubhai Patel. The event was to be conducted in a hall that had a seating capacity of about 300 students.</p>\r\n<p>We finally went to the school on the 23rd of September. Six WIE members took turns to address general student concerns pertaining to scope various fields.</p>\r\n<p>The event proceeded in the following way:</p>\r\n<p>1. Introductory speech by Hetaswi Vankani on what is IEEE and WIE</p>\r\n<p>2. Speech by Shirali Desai on Women In Engineering and how important is it for women to keep abreast with the latest technologies.</p>\r\n<p>3. Speech by Vedang Patel on career opportunities in the field of Engineering.</p>\r\n<p>4. Speech by Parth Mehta exploring the possibilities in the field of Biotech and Medicine.</p>\r\n<p>5. Hetaswi Vankani spoke on the career opportunities in the field of Pure Science, Arts and Fine Arts.</p>\r\n<p>6. Poojan Shah explored possibilities for students wanting to pursue commerce or related fields.</p>\r\n<p>7. Maullik Padia concluded by telling the students about the importance of higher education</p>\r\n<p>The WIE members primarily spoke about the importance of studying a particular subject, colleges offering related courses and preparation required for the same starting from the 11th grade. We tried to the best of our capacity to present before them the innumerable opportunities that they have and explained to them that they need to explore their interest, set goals and work hard to achieve it. At the end of the lecture series a small quiz was conducted by Parth Mehta. The students who gave correct answers to the questions were given prizes.</p>\r\n<p>Result:</p>\r\n<p>Unfortunately, the students werenâ€™t privileged enough to have had the right guidance for proper preparation for other exams that they would be required to give after their 12th grade for admission to premiere institutes. It was indeed a pleasure to guide students who were in the same state that we were a couple of years back. However, we had been fortunate enough to have had the right guidance at the right time. The students were motivated to explore their interests and start the required preparation with immediate effect.</p>\r\n<p>It thus turned out to be a successful WIE event where the WIE members addressed a problem on the humanitarian front.</p>\r\n<p>WIE Volunteers for this activity:</p>\r\n<p>Parth Mehta (Branch Secretary)</p>\r\n<p>Vedang Patel (Branch Publicity Committee member)</p>\r\n<p>Poojan shah (Branch Membership Development Officer)</p>\r\n<p>Maullik Padia (Branch Treasurer)</p>\r\n<p>Â </p>\r\n<p><span style="text-decoration: underline;"><strong>Activity: Motivational Talk by members of SEWA</strong></span></p>\r\n<p>Purpose:</p>\r\n<p>The IEEE Student Branch, Dhirubhai Ambani Institue of Information and Communication Technology, Gandhinagar had organised a 2-Day annual technical festival, i.fest, on 25th-26th September, 2010. It was an inter college technical - cum - fun festival which consisted of many technical events offline and online events, fun events, and technical and motivational talks by eminent people.</p>\r\n<p>As a promotional event of WIE, the WIE affinity group of the IEEE Student Branch, DA-IICT decided to conduct a motivational talk by some women who were experts in their respective fields. We had the opportunity to target not only the students of our college, but also spread awareness about WIE at other colleges as well, through this event.</p>\r\n<p>Selection:</p>\r\n<p>SEWA (Self Employed Womenâ€™s Association) is an all women, not for profit NGO established in Ahmedabad in 1994. The NGO is involved with women empowerment and provides employment opportunities to rural women. It is a self sustained and well run organisation by women which also plays an active role in introduction of technology and science at the rural level.</p>\r\n<p>This organisation was targeted for the WIE promotional event as it was felt that SEWA being a well known and well established organisation in Ahmedabad would succeed in attracting huge participation from the colleges of Ahmedabad and Gandhinagar.</p>\r\n<p>Planning:</p>\r\n<p>The chairperson of SEWA, Ms. Reema Nanavaty, was contacted and after a meeting Ms. Nanavaty and her team were more than willing to comply with us.</p>\r\n<p>The Event:</p>\r\n<p>A motivational lecture was delivered by the senior coordinator and trustee of SEWA, Ms. Bharti Bhavsar and one of the rural women employees, Ms. Roshni. The lecture was supplemented by a promotional video of their organisation, SEWA. The set of lectures were aimed at motivating the students, especially the girls, to pursue further in the field of technology and science. Along with that, students were also encouraged to themselves motivate fellow juniors, especially girls, to take up engineering as their profession which presents vast number of opportunities to its pursuers.</p>\r\n<p>After the lectures, upon special request from the SEWA members, there was a small exhibition cum sale of handicrafts made by the rural women employed by SEWA organised for a day. All the entities on display were hand made by the women. It was another way to promote the fact that technology in the hands of women can do wonders.</p>\r\n<p>Result:</p>\r\n<p>The lectures of the members of SEWA were well attended by students of our college and other colleges alike. It was also noticed that the girl participation in the audience dominated, which was a good sign. Hence, as a promotional event for WIE, it proved out to be a good initiative taken.</p>', '', 1, 0, 0, 32, '2011-03-30 06:52:45', 42, '', '2011-04-01 00:04:30', 42, 42, '2011-04-15 11:51:12', '2011-03-30 06:52:45', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 9, 0, 0, '', '', 1, 382, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(54, 110, 'Executive Committee(2012-2013)', 'executive-committee2011-2012-wie', '', '<table width="537" border="1" cellspacing="0" cellpadding="0"><colgroup><col style="width: 116pt;" width="155"> <col style="width: 80pt;" width="106"> <col style="width: 60pt;" width="80"> <col style="width: 100pt;" width="133"> <col style="width: 47pt;" width="63"> </colgroup>\r\n<tbody>\r\n<tr style="height: 15pt;">\r\n<td style="height: 15pt; width: 116pt;" width="155" height="20">Megha<span>Â  </span>Tak</td>\r\n<td class="xl65" style="width: 80pt;" width="106">WIE Chair</td>\r\n<td style="width: 60pt;" align="right" width="80">9016079507</td>\r\n<td style="width: 100pt;" width="133">megha_tak_kota@yahoo.co.in</td>\r\n<td style="width: 47pt;" align="right" width="63">90815276</td>\r\n</tr>\r\n<tr style="height: 15pt;">\r\n<td style="height: 15pt;" height="20">Ankita Mehta</td>\r\n<td class="xl65">WIE<span>Â  </span>Vice- Chair</td>\r\n<td align="right">9979641775</td>\r\n<td>ankitamehta1610@gmail.com</td>\r\n<td align="right">91091758</td>\r\n</tr>\r\n<tr style="height: 15pt;">\r\n<td style="height: 15pt;" height="20">Vani Alamkrutha Mogili</td>\r\n<td class="xl66">WIE Secretary</td>\r\n<td>9173184984Â </td>\r\n<td class="xl67"><a href="mailto:201001220@daiict.ac.in">201001220@daiict.ac.in</a></td>\r\n<td align="right">91217682</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>Â </p>', '', 1, 0, 0, 24, '2011-03-30 06:56:21', 42, '', '2012-04-10 19:42:59', 42, 0, '0000-00-00 00:00:00', '2011-03-30 06:56:21', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 13, 0, 1, '', '', 1, 469, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(55, 111, 'Events', 'events2011-2012-wie', '', '<p>Â </p>\r\n<p><span style="text-decoration: underline;"><strong>Activity: Workshop on Sensor Networks</strong></span></p>\r\n<p>Purpose:Â Tasks that were earlier considered either impossible or rather tough have been made possible by the use of sensors. These devices have innumerable applications right from weather forecasting (humidity sensors, pressure sensors, etc) to robotic applications; sensors have become an integral part of any automated detection system. Biosensors, accelerometers, gyrosensors, humidity sensor, acoustic sensors, pH sensors, Oxygen sensors, nanosensors, are some of the many sensors available.</p>\r\n<p>The introductory workshop aims at providing an opportunity to learn about these field of study , its future and ongoing work through lecture series and a demo session.</p>\r\n<p>Â </p>\r\n<p><strong>Selection:</strong></p>\r\n<p>The following professors have been approached:</p>\r\n<p><strong>Prof. Sanjay Srivastava</strong></p>\r\n<p>Dr. Sanjay Srivastava is a senior professor at DA-IICT. He holds his Ph.D in Physics from University of California, Los Angeles, USA. His areas of interest include Computer Networks: Protocol Modeling and Simulation.</p>\r\n<p>Web Page: http://intranet.daiict.ac.in/~sanjay_srivastava/</p>\r\n<p>Â </p>\r\n<p><strong>Prof. Prabhat Ranjan</strong></p>\r\n<p>Dr. Prabhat Ranjan is a senior professor at DA-IICT. He has done his B.Sc.in Physics from IIT Kharagpur (1979), and M.Sc.(Physics) from Delhi University (1981). He has obtained his PhD in Physics from University of California, Berkeley, USA. His areas of interest include Wireless Sensor Network, Robotics and Embedded systems, Nuclear fusion, Linux operating system.</p>\r\n<p>Web Page: http://intranet.daiict.ac.in/~ranjan/</p>\r\n<p>Â </p>\r\n<p><strong>Prof. Laxminarayan Pillutla</strong></p>\r\n<p>Dr. Laxminarayan Pillutla is a senior professor at DA-IICT. He has obtained his maters degree from Wichita State University, Wichita, KS, USA, under the guidance of Dr. Sudharman Jayweera and holds a PhD in Electrical Engineering from University of British Columbia, Canada. His areas of interest include Statistical signal processing, information theory, game theory, non-linear optimization, wireless sensor networks, cognitive radio, cross layer design of wireless networks.</p>\r\n<p>Web Page: http://intranet.daiict.ac.in/~laxminarayana_pillutla/</p>\r\n<p>Â </p>\r\n<p><strong>Planning: </strong>Professors have been contacted and the volunteers have been assigned the work. A registration site has been designed for the event. Posters and pre-event awareness are the main modes of publicity. A rebate would be offered to women participants.</p>\r\n<p>Â </p>\r\n<p>The workshop will have:</p>\r\n<p>1. Lectures On</p>\r\n<p><span style="white-space: pre;"> </span>a. What are sensors?</p>\r\n<p><span style="white-space: pre;"> </span>b. Applications</p>\r\n<p><span style="white-space: pre;"> </span>c. Latest developments in the fields</p>\r\n<p><span style="white-space: pre;"> </span>d. Wireless Sensor Network Protocol</p>\r\n<p>Â </p>\r\n<p>2. A demo session(ON REAL LIFE SENSOR NODES)</p>\r\n<p>Â </p>\r\n<p>Date: 10th April, 2011</p>\r\n<p>Time: 9a.m. to 4p.m.</p>\r\n<p>Venue: DA-IICT, Gandhinagar</p>\r\n<p>Â </p>', '', 1, 0, 0, 24, '2011-03-30 06:57:42', 42, '', '2011-08-04 08:48:30', 42, 0, '0000-00-00 00:00:00', '2011-03-30 06:57:42', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 18, 0, 2, '', '', 1, 451, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
