(83, 157, 'FAQ', 'faq', '', '<h1>FAQs about IEEE and IEEE Student Branch DAIICT</h1>\r\n<h2><strong>What is IEEE?</strong></h2>\r\n<p>The IEEE, a non-profit organization, is the world''s leading professional<br />association for the advancement of technology. The full name of the IEEE<br />is the Institute of Electrical and Electronics Engineers, Inc., although the<br />organization is referred to by the letters I-E-E-E and pronounced Eye-triple-E.<br />Through its global membership, the IEEE is a leading authority on areas ranging<br />from aerospace systems, computers and telecommunications to biomedical<br />engineering, electric power and consumer electronics among others. Members<br />rely on the IEEE as a source of technical and professional information,<br />resources and services.</p>\r\n<p><br />To foster an interest in the engineering profession, the IEEE also serves student<br />members in colleges and universities around the world. Other important<br />constituencies include prospective members and organizations that purchase<br />IEEE products and participate in conferences or other IEEE programs.</p>\r\n<p><br /><span style="text-decoration: underline;"><strong>Tell me about the IEEE organizations in India?</strong></span></p>\r\n<p><br />The IEEE is geographically made up of 10 Regions and 330 Sections worldwide.<br />India belongs to Region 10 (Asia-Pacific area) and holds IEEE India Council,<br />which coordinates the inter-Sectional activities of the ten Sections and also<br />to provide effective representation and support for the Sections in India. <span style="text-decoration: underline;">IEEE</span><br /><span style="text-decoration: underline;">India Council</span> holds eleven sections, namely, <span style="color: blue;">Bangalore, Bombay, Calcutta,<br />Delhi, Gujarat, Hyderabad, Kerala, Kharagpur, Madras,<span style="text-decoration: underline;"> <a href="http://ewh.ieee.org/r10/pune/" target="_blank">Pune </a></span>and Uttar<br />Pradesh</span> Section.</p>\r\n<h2><br /><strong>Why join IEEE?</strong></h2>\r\n<p>The IEEE is connecting more than 400,000 members to the latest information<br />and the best technical resources available. IEEE Student Membership is<br />a unique way to gauge the benefits of IEEE membership but at reduced<br />membership rates. As student members you get almost all the resources you<br />require to develop your future career. From continuing education courses and<br />certifications, to conferences and competitions, you can learn more, create<br />more , and achieve more of what matters in your life and career through IEEE<br />membership. IEEE membership helps support the IEEE mission of promoting</p>\r\n<p><br />the engineering profession for the benefits of humanity and the profession.</p>\r\n<p><br />More About IEEE: <a href="http://www.ieee.org/index.html" target="_blank">http://www.ieee.org/index.html</a></p>\r\n<h2><br />What are the benefits of being an IEEE member?</h2>\r\n<p><br />1. Keep Technically Current</p>\r\n<ul>\r\n<li>Discover career opportunities and gain a better understanding of your field.</li>\r\n<li>IEEE Spectrum and IEEE Potentials magazines.</li>\r\n<li>IEEE e-books classics (<a href="http://www.ieee.org/membership_services/membership/products/ebookclassics.html" target="_blank">http://www.ieee.org/membership_services/membership/products/ebookclassics.html</a>)</li>\r\n<li>IEEE Xplore Abstracts of Research Papers</li>\r\n<li>IEEE TV</li>\r\n</ul>\r\n<p><br />2. Career Recognition and Resources</p>\r\n<ul>\r\n<li>Awards, Scholarship</li>\r\n<li>IEEE Job Site</li>\r\n<li>Continuing Education Provider Program.</li>\r\n<li>IEEE Mentoring Organization.</li>\r\n</ul>\r\n<p><br />3. Professional Networking</p>\r\n<ul>\r\n<li>Membership Networking</li>\r\n<li>Online Communities</li>\r\n<li>Networking with different IEEE Members of college student branch and state section</li>\r\n<li>Volunteering : Improve your organization skills, team work and leadership skills.</li>\r\n</ul>\r\n<p><br />4. Discounts</p>\r\n<ul>\r\n<li>On Events to be organized by IEEE Student Branch DAIICT</li>\r\n<li>Dell Laptop (from 3 to 8%) (<a href="https://www.ieee.org/membership_services/membership/discounts/secure/dell_mpp.html" target="_blank">https://www.ieee.org/membership_services/membership/discounts/secure/dell_mpp.html</a>)</li>\r\n<li>IEEE Conferences</li>\r\n<li>Free Microsoft Softwares (<a href="http://www.ieee.org/membership_services/membership/students/students_software.html" target="_blank">http://www.ieee.org/membership_services/membership/students/students_software.html</a>)</li>\r\n</ul>\r\n<p><br />More about IEEE Membership: <a href="http://www.ieee.org/membership_services/membership/benefits/benefits.html?benefitCareerPhase=All&amp;benefitCountry=All" target="_blank">http://www.ieee.org/membership_services/membership/benefits/benefits.html?benefitCareerPhase=All&amp;benefitCountry=All</a></p>\r\n<h2><a href="http://www.ieee.org/membership_services/membership/benefits/benefits.html?benefitCareerPhase=All&amp;benefitCountry=All" target="_blank"><br /></a>What is IEEE Membership Fees?</h2>\r\n<p><br />The following information is for Asia-Pacific Region.</p>\r\n<p><br />Half-Year Membership: Rs 650<br />Full-Year Membership: Rs 1350<br /><br /></p>\r\n<ul>\r\n<li>Half yearly rates applied to new members only.</li>\r\n<li>IEEE membership runs from 1 January through 31 December.</li>\r\n<li>NEW applications received between 16 August 2011 and 28 February 2012 will automatically be processed at the full year dues rates. Services begin immediately.</li>\r\n<li>NEW applications received between 1 March and 15 August 2012 will automatically be processed for half-year membership ending 31 December 2012 at the half-year dues rates. Exception is when the applicant specifically requests their application be processed for the full year. However, we cannot guarantee availability of back issues of all publications for the first half of the calendar year.</li>\r\n</ul>\r\n<p><br />More About Fee Payment: <a href="http://www.ieee.org/membership_services/membership/join/join_dues.html" target="_blank">http://www.ieee.org/membership_services/membership/join/join_dues.html</a></p>\r\n<h2>How to submit IEEE Membership Fees?</h2>\r\n<p><br />Student can submit the membership fee to any committee member of IEEE, Student Branch. IEEE Student Branch would fill and submit the fee to IEEE India on behalf of student.<br /><br />IEEE Student Branch starts membership drive half-yearly. Students of DAIICT would be informed about membership drive through a mail.</p>\r\n<h2><br />What is IEEE Student Branch DA-IICT?</h2>\r\n<p><br />When students join IEEE, they automatically become members of the IEEE Student Branch at their university or college. Students, like professional members, automatically become members of their local IEEE Section and<br />Region, allowing them to share technical, professional and personal interests with others in IEEEâ€™s worldwide member community.</p>\r\n<p><br />IEEE Student Branch, DA-IICT aims to provide an interactive platform for students to develop professional and technical abilities. Since the inception, it is successful in organizing various national and state events with well defined objectives.<br /><br />IEEE Student Branch Website: <a target="_self">http://ieee.daiict.ac.in/ieee2012/</a></p>\r\n<h2><br />What are the benefits of joining IEEE Student Branch EXECOM at DA-IICT?</h2>\r\n<p><br />You will gain exposure by organizing events and interacting with other members. Earn certificates, awards and accolades which gives you an edge over others in placement.<br /><br />All EXECOM members of IEEE Student Branch are volunteers. But on the basis of experience and responsibility, there are certain positions in the committee.</p>\r\n<p><br />So a fresher in the committee is given volunteer position. After 1 year, new committee is formed through interviews. Up gradation of the position of previous yearâ€™s members take place on the basis of his/her involvement and his/her devotion towards IEEE Student Branch DA-IICT.<br /><br />Current IEEE Student Branch EXECOM: <a href="index.php/branch-information/branch-execomm" target="_blank">http://ieee.daiict.ac.in/ieee2012/index.php/branch-information/branch-execomm</a></p>\r\n<h2><br />What is WIE?</h2>\r\n<p><br />IEEE Women in Engineering (WIE) is the largest international professional<br />organization dedicated to promoting women engineers and scientists.<br /><br />The mission of IEEE WIE is to facilitate the recruitment and retention of women<br />in technical disciplines globally.<br /><br />IEEE WIE envisions a vibrant community of IEEE women and men collectively<br />using their diverse talents to innovate for the benefit of humanity.<br /><br />More about WIE: <a href="index.php/wie" target="_blank">http://ieee.daiict.ac.in/ieee2012/index.php/wie</a><br /><br /><span style="text-decoration: underline;"><strong>Events organized by our student branch in the year 2011-12?</strong></span><br /><br />Events in 2011:<br /><br /><strong>1. Summer School 2011</strong><br /><br />More Details: <a href="../summerschool/" target="_blank">http://ieee.daiict.ac.in/summerschool/</a><br /><br /><strong>2. i.Fest-2011</strong><br /><br />More Details: <a href="../ifest/" target="_blank">http://ieee.daiict.ac.in/ifest/</a><br /><br /><strong>3. WIE Congress 2011</strong><br /><br />More Details: <a href="../wiecongress/" target="_blank">http://ieee.daiict.ac.in/wiecongress/</a><br /><br /><strong>4. GIS Workshop</strong><br /><br />More Details: <a href="../gis/" target="_blank">http://ieee.daiict.ac.in/gis/</a><br /><br /><strong>5. SPAC-Student Professional Awareness Conference</strong><br /><br />More Details: <a href="../spac/register.html" target="_blank">http://ieee.daiict.ac.in/spac/register.html</a><br /><br /><strong>6. Sensor Network Workshop</strong><br /><br />More Details: <a href="../sensornetwork/" target="_blank">http://ieee.daiict.ac.in/sensornetwork/</a><br /><br /><strong>7. Symposium on Artificial Intelligence</strong><br /><br />More Details: <a href="../ai/" target="_blank">http://ieee.daiict.ac.in/ai/</a><br /><br />Events in ongoing 2012:<br /><br /><strong>1. Summer School 2012</strong><br /><br />More Details: <a href="../summerschool12/" target="_blank">http://ieee.daiict.ac.in/summerschool12/</a><br /><br /><strong>2. Arduino Worshop</strong><br /><br /><strong>3. NS2 Workshop</strong><br /><br />More Details: <a href="../wns2/" target="_blank">http://ieee.daiict.ac.in/wns2/</a><br /><br />Planned Events in ongoing 2012:<br /><br /><em>1. Industrial Visit- August month</em><br /><br /><em>2. i.Fest 2012- October month</em><br /><br /><em>3. Information Retrieval Workshop</em><br /><br />More details:<br /><br /><a href="index.php/events" target="_blank">http://ieee.daiict.ac.in/ieee2012/index.php/events</a></p>\r\n<h2><br />What is SIG?</h2>\r\n<p><br />SIG''s are Special Interest Groups which were initiated by the student branch two years ago. These were introduced as a platform where students of all years could share interesting ideas and articles in the fields of Embedded Systems and Computer Science with their peers.<br /><br />Presently IEEE Student Branch conducts SIG Embedded and SIG Programming Sessions fortnightly.</p>\r\n<h2><br />What is IAS?</h2>\r\n<p><br />Industry Applications Society is a global society of IEEE, which provides an exposure to the industries and applications of learned technology in real life.<br /><br />With 10,000 members across the globe, it is a very important society with renowned people from academia and industry being a part of it.<br /><br />Student members of the same, get the opportunity to reach out to these people and explore the various possibilities for our self. Also it helps them to interact with other IAS branches around the 6 continents.<br /><br />More Details about IAS: <a href="http://ias.ieee.org" target="_blank">http://ias.ieee.org</a><br /><br />How to contact IEEE Student Branch EXECOM Members?<br /><br /><span style="text-decoration: underline;"><strong>Mail your query at ieee@daiict.ac.in.</strong></span><br /><br />** Some points are taken from ieee.org.</p>', '', 1, 0, 0, 2, '2012-07-29 13:14:37', 42, '', '2012-07-29 13:21:09', 42, 42, '2012-07-29 13:21:09', '2012-07-29 13:14:37', '0000-00-00 00:00:00', '', '', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","alternative_readmore":"","article_layout":""}', 3, 0, 0, '', '', 1, 87, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', '');
