INSERT INTO `site2012_jevents_vevdetail` (`evdet_id`, `rawdata`, `dtstart`, `dtstartraw`, `duration`, `durationraw`, `dtend`, `dtendraw`, `dtstamp`, `class`, `categories`, `color`, `description`, `geolon`, `geolat`, `location`, `priority`, `status`, `summary`, `contact`, `organizer`, `url`, `extra_info`, `created`, `sequence`, `state`, `modified`, `multiday`, `hits`, `noendtime`) VALUES
(1, '', 1325817000, '', 0, '', 1326022200, '', '', '', '', '', '<div class="content">\r\n<h2>NS2- Network Simulator Workshop</h2>\r\n<p>With the new semester coming up, here comes IEEE once again to enhance your creative skills and learn more about the technological advancements around the globe.</p>\r\n<p>With this aim IEEE Gujarat Section along with IEEE Student Branch,DA-IICT bring to a workshop on NS2 - Network Simulator on 6-8th January 2012 at DA-IICT. The aim of this workshop is to provide understanding the architecture and working of ns2 and provides hands of training in ns2 to networking researchers from both academia and industry. The workshop also aims to brief the evolution of ns-2, now that ns-3 and it''s extension in novel research areas and networking technologies and scenarios.</p>\r\n<p>It is highly recommended for postgraduates to attend the workshop as this a a very important tool and also for undergraduates who wish to pursue studies in networking field.</p>\r\n<h2>Topics:</h2>\r\n<p>1. Overview of NS2 and TCL</p>\r\n<p>2. Wired Network Simulation</p>\r\n<p>3. Wireless Network Simulation</p>\r\n<p>4. Implementing Routing Protocols</p>\r\n<p>5. Congestion Control Strategies</p>\r\n<p>6. Simulating TCP Protocol</p>\r\n</div>', 0, 0, 'DA-IICT', 0, '', 'NS2- Network Simulator Workshop', '', '', '', '', '', 0, 1, '2012-04-10 22:25:34', 1, 2, 0),
(2, '', 1333593000, '', 0, '', 1333625400, '', '', '', '', '', '<p>We all love micro controllers, in some way or the other. The great things they can do always encourages us to learn how to work with them and believe me, with Arduino, now anyone, even a school kid can program and do fantastic stuff with it.<br /><br />So the IEEE Student Branch DA-IICT is organizing an Arduino workshop, which will help all of you to get introduced to the fascinating world of Arduino and see its immense power especially when the ease of coding is concerned, and you will also get a chance to interface it with some common sensors and actuators, hands-on, so that you can go home and start working on the next-big-thing straight away!!!<br /><br />Some of the contents include:<br />1) What is a micro-controller ? What is Arduino ?<br />2) Basic Arduino programming concepts.<br />3) Hands-on interfacing with Arduino boards : LEDs, Light Sensors, Motors etc.<br />4) Interesting projects using combination of techniques learned.<br />And much more...</p>', 0, 0, 'DA-IICT', 0, '', 'Arduino Workshop', '', '', '', '', '', 0, 1, '2012-04-10 22:29:05', 1, 29, 0),
(3, '', 1334237400, '', 0, '', 1334255399, '', '', '', '', '', '<p><span> The IEEE Student Branch, DA-IICT is organizing the Programming SIG (Special Interest Group). It will be the perfect place to brag and discuss your programming brainchild. The event is open for members as well as non-members. We would be having some students who have worked on some really interesting projects demonstrating their work. Even you can come on to the podium and join them impromptu, if you want. It will also be a very good opportunity if you want to start getting involved in programming projects.<br /><br />This weeks session basically aims at finding different means to publish your projects.<br /><br />For this week''s SIG we have already lined up the following for you:<br /><br />1) GitHub Pages for publishing your projects : Don''t worry if you are not familiar with git or GitHub. We''ll be providing a crash course or a short introduction. GitHub Pages can be used to attractively publish your projects. We''ll be publishing a small Flash game on to our pages.<br /><br />2) Publishing Apps on Facebook : We can publish the same Flash game on Facebook too. As a result, you have a Facebook game app generated in no time.<br /></span></p>', 0, 0, 'CEP 110, DA-IICT', 0, '', 'SIG Programming - Publish Apps on Facebook', 'Vishrut (9925236332)', '', '', '', '', 0, 1, '2012-04-10 22:31:35', 1, 35, 1),
(4, '', 1339381800, '', 0, '', 1340648999, '', '', '', '', '', '<p>Summer School will give you intensive instruction in the proposed tracks delivered by top faculty and special guest lecturers and colloquial speakers. This is a great opportunity to explore and enhance your skills in some of the most trending topics in the world of Technology. You will get to meet and work with experts in the area. You will get a full hands-on experience as you will be developing your own products in the last few days.</p>\r\n<h2>Official website: <a href="../summerschool12/" target="_blank">http://ieee.daiict.ac.in/summerschool12/</a></h2>\r\n<p>Please feel free to call us for more information.</p>\r\n<p>Anshul Agrawal (+9377924080)<br /> Amar Mehta (+9510180030)<br /> Ravi Goyal (+8905057271)<br /> Rashmi S. Reddy (+9924782437)<br /> Saumik Trivedi (+9408533211)</p>', 0, 0, 'DA-IICT, Gandhinagar, Gujarat', 0, '', 'Summer School 2012', 'Anshul Agrawal (+9377924080)', '', '', '', '', 0, 1, '2012-05-29 17:13:37', 0, 79, 1),
(5, '', 1342618200, '', 0, '', 1342636199, '', '', '', '', '', '<p>SIG: Embedded Orientation Session for Freshers</p>\r\n<p>For further information, please contact Atin Jain (<a>atin_jain@daiict.ac.in</a>) (Phone: 8000502199)</p>', 0, 0, 'CEP 102, DA-IICT', 0, '', 'SIG: Embedded Orientation Session for Freshers', 'Atin Jain (atin_jain@daiict.ac.in) (Phone: 8000502199)', '', '', '', '', 0, 1, '2012-07-15 21:42:00', 1, 32, 1),
(6, '', 1342704600, '', 0, '', 1342722599, '', '', '', '', '', '<p>SIG: Embedded Introductory Session for Freshers</p>\r\n<p>For further information, please contact Atin Jain (<a>atin_jain@daiict.ac.in</a>) (Phone: 8000502199)</p>', 0, 0, 'CEP 102, DA-IICT', 0, '', 'SIG: Embedded Introductory Session for Freshers', 'Atin Jain (atin_jain@daiict.ac.in) (Phone: 8000502199)', '', '', '', '', 0, 1, '2012-07-15 21:41:27', 1, 26, 1),
(7, '', 1347129000, '', 0, '', 1347129000, '', '', '', '', '', '<p><span style="color: #222222; font-family: ''Times New Roman''; font-size: 16px; line-height: normal;">1-day Workshop on Information Retrieval - Organised by WIE</span></p>', 0, 0, 'DA-IICT', 0, '', '1-day Workshop on Information Retrieval', 'megha_tak@daiict.ac.in', '', '', '', '', 0, 1, '2012-09-05 02:49:44', 1, 21, 0),
(8, '', 1348252200, '', 0, '', 1348252200, '', '', '', '', '', '<p><span style="color: #222222; font-family: ''Times New Roman''; font-size: 16px; line-height: normal;">DevFest & Hackathon - Organised in association with GDG, Gandhinagar</span></p>', 0, 0, 'DA-IICT', 0, '', 'DevFest & Hackathon', 'Sharan Shodhan - sharan_shodhan@daiict.ac.in', '', '', '', '', 0, 1, '2012-09-05 02:51:38', 1, 23, 0),
(9, '', 1349375400, '', 0, '', 1349634599, '', '', '', '', '', '<p>IEEE i.Fest 2012</p>\r\n<p>Event website link will be posted soon!</p>', 0, 0, 'DA-IICT', 0, '', 'i.Fest 2012', 'Ravi Goyal - ravi_goyal@daiict.ac.in', '', '', '', '', 0, 1, '2012-09-05 02:53:33', 1, 64, 0);
