(28, 'Write to us', '', '', 1, 'left-menu', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'mod_rapid_contact', 1, 1, '{"email_recipient":"ieee@daiict.ac.in","from_name":"Write to us","from_email":"ieee@daiict.ac.in","email_label":"Email:","subject_label":"Subject:","message_label":"Message:","button_text":"Send Message","page_text":"Thank you for your contact.","error_text":"Your message could not be sent. Please try again.","no_email":"Please write your email","invalid_email":"Please write a valid email","wrong_antispam":"Wrong Anti-Spam Answer","pre_text":"","thank_text_color":"#FF0000","error_text_color":"#FF0000","email_width":"15","subject_width":"15","message_width":"13","button_width":"100","label_pos":"0","addcss":"div.rapid_contact tr, div.rapid_contact td { border: none; padding: 3px; }","exact_url":"1","disable_https":"1","fixed_url":"0","fixed_url_address":"","enable_anti_spam":"1","anti_spam_q":"How many eyes has a typical person?","anti_spam_a":"2","anti_spam_position":"0","moduleclass_sfx":"","cache":"1","cache_time":"900"}', 0, '*'),
(29, 'IEEE', '', '<p class="rightTxt1">The IEEE formed in 1963 with the merger of theÂ <strong>AIEE</strong> (American Institute of Electrical Engineers, formed in 1884), and theÂ <strong>IRE</strong> (Institute of Radio Engineers, formed in 1912).</p>\r\n<p class="rightTxt1">Through its members, the IEEE is a leading  authority in technical areas ranging from computer engineering,  biomedical technology and telecommunications, to electric power,  aerospace and consumer electronics, among others.</p>\r\n<p class="MsoNormal"><a href="http://www.ieee.org/"><span style="color: #1b57b1; text-decoration: none;">More about IEEE</span></a></p>', 1, 'user4', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'mod_custom', 1, 1, '{"prepare_content":"1","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(30, 'IEEE Region 10', '', '<p class="MsoNormal">The IEEE Region 10, or sometimes referred to the Asia Pacific Region comprises 4 Councils, 47 Sections, 6 Sub-sections, 211 Chapters and 245 student branches. It covers a geographical area stretching from South Korea and Japan in the north-east to New Zealand in the south, and Pakistan in the west. With a membership in of about 60,000, it is one of the largest and fastest growing regions in IEEE.There are 10 sections in India which comes under IEEE Region 10.</p>\r\n<p class="MsoNormal"><a href="http://www.ewh.ieee.org/reg/10/">More about Region 10</a></p>\r\n<p class="MsoNormal">Â </p>', 1, 'user5', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'mod_custom', 1, 1, '{"prepare_content":"1","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(31, 'IEEE Gujarat Section', '', '<p>The IEEE Gujarat Section endeavors to promote awareness among students on the opportunities that exist in the field of electronics and electrical engineering. Our objective is to bridge the gap between industry and students studying in technology-related fields, while promoting and providing an intellectually stimulating university environment for the student body.</p>\r\n<p>IEEE Gujarat Section is one of the 10 Sections in India coming under Asia-Pacific Region, the Region 10 of IEEE. We have 1 Fellow, 25 Senior Members, 170 Members and 15 Associate Members. In past years, IEEE Gujarat Section was very active in organizing various state and national level technical events for the benefit of student of Gujarat, in particular.</p>\r\n<p class="MsoNormal"><a href="http://ewh.ieee.org/r10/gujarat">More about IEEE Gujarat Section</a></p>', 1, 'user6', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'mod_custom', 1, 1, '{"prepare_content":"1","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
(32, 'About R10', '', '<p class="MsoNormal">The IEEE Region 10, or sometimes referred to the Asia Pacific Region comprises 4 Councils, 47 Sections, 6 Sub-sections, 211 Chapters and 245 student branches. It covers a geographical area stretching from South Korea and Japan in the north-east to New Zealand in the south, and Pakistan in the west. With a membership in of about 60,000, it is one of the largest and fastest growing regions in IEEE.There are 10 sections in India which comes under IEEE Region 10.</p>\r\n<p class="MsoNormal"><a href="http://www.ewh.ieee.org/reg/10/">More about Region 10</a></p>\r\n<p class="MsoNormal">Â </p>', 1, 'user5', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', -2, 'mod_custom', 1, 1, '{"prepare_content":"1","layout":"_:default","moduleclass_sfx":"","cache":"1","cache_time":"900","cachemode":"static"}', 0, '*'),
